INSERT [dbo].[DoanhNghiepBDS] ([Id], [Ten], [DiaChi], [SoDienThoai], [Email], [Website], [GioiThieu], [AnhDaiDien]) VALUES (1, N'Công ty CP Tập đoàn VietPearl', N'215 - B1 Nguyễn Văn Hưởng, Thảo Điền, Quận 2, Hồ Chí Minh, Việt Nam', N'0933883374', N'VietPearl@vp.com', N'http://vietpearlgroup.com/', N'<div id="broker_intro">
	<p>
		<strong>Công ty Cổ phần Tập đoàn VietPearl được thành lập vào ngày 27/07/2007. Với hơn 10 năm hình thành và phát triển, hiện VietPearl Group đang nắm giữ vị thế của một trong những nhà đầu tư phát triển bất động sản hàng đầu Tp.HCM.</strong></p>
	<p>
		Để có được những bước đi vững chắc và thành công, VietPearl Group đã đưa ra chiến lược phát triển kinh doanh “Đa ngành nghề – Đa sở hữu – Đa quốc gia” bên cạnh sứ mệnh cung cấp các dự án bất động sản (căn hộ du lịch biển, condotel, khu đô thị biệt thự nghỉ dưỡng, khu phức hợp, thương mại dịch vụ...).</p>
	<p>
		Theo đó, từ năm 2014 đến nay, VietPearl Group đã cho ra đời các công ty thành viên, kinh doanh trong nhiều lĩnh vực khác nhau như Công ty Cổ phần Silverland; Nhà máy xử lý chất thải Tuấn Đạt; Công ty TNHH Thương Mại Quân Vũ; Công ty phát triển dự án vietpearl &TAB...</p>
	<p>
		Trong kế hoạch phát triển Tập đoàn giai đoạn ‎2018 – 2025, mục tiêu hướng tới của Công ty CP Tập đoàn VietPearl là “Thực hiện đầu tư 09 dự án và phát triển toàn diện với các chủ đầu tư dự án”. Chính vì vậy, doanh nghiệp đang tập trung mọi nỗ lực phát triển nguồn nhân lực, nâng cao tiềm lực tài chính và ứng dụng công nghệ hiện đại nhằm đem đến cho khách hàng các dòng sản phẩm độc đáo, chất lượng cùng phong cách phục vụ chuyên nghiệp nhất.</p>
	<p>
		<strong>Giá trị cốt lỗi</strong></p>
	<p>
		- Cam kết về chất lượng cơ sở hạ tầng của dự án<br />
		- Tinh thần trách nhiệm của nhân viên đối với khách hàng<br />
		- Tinh thần lãnh đạo tốt, phù hợp với công việc<br />
		- Môi trường làm việc chuyên nghiệp sống động <br />
		- Kỷ luật, trung thực và tin cậy</p>
	<p>
		<strong>Lĩnh vực hoạt động</strong></p>
	<p>
		- Đầu tư – Kinh doanh Bất động sản<br />
		- Đầu tư xây dựng kinh doanh kết cấu hạ tầng khu công nghiệp, khu dân cư<br />
		- Xử lý chất thải nguy hại<br />
		- Tư vấn và tiếp thị bất động sản<br />
		- Tư vấn đầu tư, xây dựng, đấu thầu<br />
		- Quản lý bât động sản, dự án đầu tư<br />
		- Dịch vụ về nhà đất bán đấu giá tài sản<br />
		- Xây dựng công trình dân dụng, kỹ thuật và trang trí nội thất<br />
		- Cho thuê kho bãi, nhà xưởng, văn phòng<br />
		- Dịch vụ về nhà đất bán, đấu giá tài sản</p>
	<p>
		<strong>Dự án thực hiện</strong></p>
	<p>
		- Oyster Gành Hào<br />
		- Edna resort Mũi Né<br />
		- Capri Island Resort<br />
		- Vietpearl Tower</p>
	<p>
		<strong>Văn phòng giao dịch:</strong> Tòa nhà Kova Center 92 G – H, đường Nguyễn Hữu Cảnh, Phường 22, Quận Bình Thạnh, Tp.HCM.</p>
</div>
<p>
	 </p>
', NULL)
GO
