INSERT [dbo].[DoanhNghiepBDS] ([Id], [Ten], [DiaChi], [SoDienThoai], [Email], [Website], [GioiThieu], [AnhDaiDien]) VALUES (3, N'Tập đoàn CapitaLand ', N' Tầng 8, tòa nhà Vista, số 628C Xa Lộ Hà Nội, phường An Phú, Quận 2, Hồ Chí Minh ', N'(08) 35191067', N'thekrista@capitaland.com', N'www.capitaland.com.vn', N'<div class="a1 introinfo">
	<p>
		<strong>Tập đoàn CapitaLand là một trong những tập đoàn bất động sản lớn nhất châu Á. Được niêm yết với trụ sở chính tại Singapore, CapitaLand hoạt động chính trong các lĩnh vực bất động sản, quản lý quỹ đầu tư bất động sản ở 2 thị trường chính Singapore và Trung Quốc.</strong></p>
	<p>
		Danh mục đầu tư bất động sản đa dạng bao gồm nhà ở, văn phòng, trung tâm thương mại, căn hộ dịch vụ và khu phức hợp. <strong>CapitaLand </strong>sở hữu một trong những quỹ đầu tư bất động sản lớn nhất Châu Á. CapitaLand cũng sở hữu những dự án bất động sản điển hình, với kinh nghiệm vững mạnh, thiết kế tiêu chuẩn cùng năng lực xây dựng, chiến lược quản lý quỹ hiệu quả và mạng lưới thị trường rộng khắp nhằm mang lại dịch vụ và sản phẩm bất động sản tốt nhất.</p>
	<p>
		<strong>Các công ty thành viên của CapitaLand đã được niêm yết:</strong></p>
	<p>
		- Ascott Residence Trust - Quỹ tín thác bất động sản về căn hộ dịch vụ đầu tiên của châu Á lớn nhất thế giới.<br />
		- CapitaCommercial Trust - Quỹ tín thác bất động sản về thương mại được niêm yết đầu tiên ở Singapore<br />
		- CapitaMall Trust - Quỹ tín thác bất động sản đầu tiên được niêm yết ở Singapore<br />
		- CapitaMalls Malaysia Trust - Quỹ tín thác bất động sản về khu phức hợp lớn nhất ở Malaysia<br />
		- CapitaRetail China Trust - Quỹ tín thác bất động sản bán lẻ Trung Quốc đầu tiên ở Singapore</p>
	<p>
		<strong>CapitaLand Việt Nam</strong></p>
	<p>
		Việt Nam là một trong những thị trường trọng điểm của CapitaLand tại châu Á. Thị trường bất động sản ở Việt Nam được sự hậu thuẫn từ nền kinh tế phát triển tốt và tốc độ đô thị hóa nhanh và dân số còn trẻ. CapitaLand cam kết là một nhà đầu tư lâu dài về bất động sản tại Việt Nam</p>
	<p>
		Tập đoàn hiện có mặt tại bốn thành phố lớn của Việt Nam là TP. HCM, Hà Nội, Hải Phòng và Đà Nẵng, đầu tư trong lĩnh vực căn hộ nhà ở và căn hộ dịch vụ. Đến nay, CapitaLand đã cung cấp cho thị trường nhà ở TP.HCM và Hà Nội hơn 6.000 căn hộ chất lượng với sáu dự án nhà ở. Ascott Limited, công ty con do CapitaLand sở hữu 100% vốn, có danh mục đầu tư gồm hơn 1.800 căn hộ dịch vụ thuộc 12 toà nhà Somerset tại bốn thành phố lớn kể trên. Ascott là chủ sở hữu kiêm nhà điều hành quốc tế về căn hộ dịch vụ lớn nhất tại Việt Nam.</p>
	<p>
		CapitaLand cam kết đóng góp cho sự phát triển của nền kinh tế Việt Nam thông qua việc tuyển dụng và đào tạo đội ngũ nhân viên địa phương, trao đổi kiến thức và kĩ năng với đối tác địa phương và đóng góp cho cộng đồng sở tại, đặc biệt là giúp đỡ trẻ em kém may mắn, bằng những hoạt động mang tính trách nghiệm xã hội doanh nghiệp.</p>
</div>
<p>
	 </p>
', N'/Content/Images/AnhDaiDienDuAn/23112019-20150508095736-683a.jpg')
GO
