INSERT [dbo].[DoanhNghiepBDS] ([Id], [Ten], [DiaChi], [SoDienThoai], [Email], [Website], [GioiThieu], [AnhDaiDien]) VALUES (5, N'Tập đoàn Vingroup ', N' Việt Hưng, Long Biên, Hà Nội, Việt Nam', N'(04) 39749999', N'info@vingroup.net', N'www.vingroup.net', N'<div class="content">
	<div class="summary">
		 </div>
	<div class="a1 introinfo">
		<p>
			<strong>Tập đoàn Vingroup tiền thân là Tập đoàn Technocom, được thành lập tại Ukraina năm 1993 bởi những người Việt Nam trẻ tuổi, hoạt động ban đầu trong lĩnh vực thực phẩm và thành công rực rỡ với thương hiệu Mivina. </strong></p>
		<p>
			Với tầm nhìn dài hạn và quan điểm phát triển bền vững, <strong>Vingroup</strong> đã tập trung đầu tư vào các lĩnh vực du lịch và bất động sản với hai thương hiệu chiến lược là Vinpearl và Vincom. 10 năm sau đó, Vinpearl đã trở thành cánh chim đầu đàn của ngành Du lịch với chuỗi các khách sạn, khu nghỉ dưỡng, khu biệt thự biển, công viên giải trí, sân golf… đẳng cấp năm sao và trên năm sao quốc tế. Trong khi đó, Vincom cũng đã trở thành thương hiệu số 1 Việt Nam về bất động sản với hàng loạt các tổ hợp Trung tâm thương mại - Văn phòng - Căn hộ đẳng cấp tại vị trí đắc địa và những khu đô thị phức hợp lớn, hiện đại, dẫn đầu cho xu thế đô thị thông minh - sinh thái hạng sang tại Việt Nam. </p>
		<p>
			Tháng 1/2012,<strong> Tập đoàn Vingroup</strong> được thành lập sau sự kiện sáp nhập của 2 công ty Bất động sản hàng đầu của Việt Nam: Công ty Cổ phần Vinpearl và Công ty Cổ phần Vincom.</p>
		<p>
			Trên tinh thần phát triển bền vững và chuyên nghiệp, Vingroup tập trung phát triển với nhiều nhóm thương hiệu, như: Vinhomes (Hệ thống bất động sản nhà ở dịch vụ đẳng cấp), Vincom (Hệ thống TTTM đẳng cấp); Vinpearl (Bất động sản du lịch, dịch vụ du lịch - giải trí); Đồng thời mở rộng ra các lĩnh vực như y tế chất lượng cao (Vinmec), phát triển giáo dục (Vinschool)…</p>
	</div>
</div>
