INSERT [dbo].[DoanhNghiepBDS] ([Id], [Ten], [DiaChi], [SoDienThoai], [Email], [Website], [GioiThieu], [AnhDaiDien]) VALUES (6, N'Công ty CP Đầu tư Địa ốc Vạn Phúc - Dai Phuc Group', N' 617-621 Điện Biên Phủ, Phường 25, Bình Thạnh, Hồ Chí Minh, Việt Nam', N'(08) 62946553', N'kinhdoanhnha@daiphuc.com.vn', N'www.daiphuc.com.vn', N'<div class="content">
	<div class="summary">
		 </div>
	<div class="a1 introinfo">
		<p>
			<strong>Được thành lập từ năm 1995, Tập đoàn Đại Phúc là một trong những doanh nghiệp tiên phong trong việc quy hoạch – đầu tư – phát triển các khu dân cư. Với hơn 15 năm kinh nghiệm, Tập đoàn đã góp phần tạo nên sự phát triển của thị trường bất động sản Việt Nam.</strong></p>
		<p>
			<strong>Các dự án đã và đang đầu tư</strong></p>
		<p>
			- Khu nhà ở Hiệp Bình Chánh (quận Thủ Đức)<br />
			- Khu nhà ở rạch Bà Tánh (huyện Bình Chánh)<br />
			- Khu dân cư đô thị mới Bình Hòa quận Bình Thạnh)<br />
			- Khu nhà ở 9B4 – 9B8 (huyện Bình Chánh)</p>
		<p>
			<strong>Mục tiêu phát triển</strong></p>
		<p>
			- Cung cấp những sản phẩm địa ốc hoàn hảo, môi trường sống bền vững và thân thiện.<br />
			- Khẳng định vị trí và uy tín của một nhà phát triển bất động sản chuyên nghiệp hàng đầu tại Việt Nam với tổng quỹ đất sạch lên đến hơn 300ha.<br />
			- Đầu tư phát triển các dự án mang tầm vóc toàn diện với công nghệ tiên tiến nhất, mang đến lợi ích cho tất cả khách hàng và đối tác của công ty.</p>
		<p>
			<strong>Lĩnh vực hoạt động</strong></p>
		<p>
			- Giáo dục mầm non, tiểu học, trung học cơ sở và trung học phổ thông;<br />
			- Xây dựng công nghiệp và dân dụng, xây dựng đường;<br />
			- Kinh doanh vật liệu, thiết bị lắp đặt khác trong xây dựng;<br />
			- San lấp mặt bằng;<br />
			- Sàn giao dịch bất động sản: kinh doanh – môi giới – cho thuê và tư vấn đầu tư bất động sản;<br />
			- Thi công lắp đặt đường dây và trạm biến áp điện đến 35Kv;</p>
	</div>
