INSERT [dbo].[DoanhNghiepBDS] ([Id], [Ten], [DiaChi], [SoDienThoai], [Email], [Website], [GioiThieu], [AnhDaiDien]) VALUES (7, N'Tập đoàn Hà Đô', N' Số 8 Láng Hạ, phường Láng Hạ, quận Đống Đa, TP. Hà Nội', N'(04) 38310347', N'hq@hado.com.vn', N'www.hado.com.vn', N'<div class="content">
	<div class="summary">
		 </div>
	<div class="a1 introinfo">
		<p>
			<strong>Từ tiền thân là Công ty xây dựng Hà Đô, hiện Hà Đô đã trở thành Tập đoàn đầu tư, xây dựng, tư vấn và kinh doanh hùng mạnh với 8 Công ty thành viên và 4 Công ty liên doanh hoạt động chuyên nghiệp.</strong></p>
		<p>
			<strong>Tập đoàn Hà Đô</strong> là tập đoàn kinh tế đa ngành, hoạt động chủ yếu trong các lĩnh vực sau:</p>
		<p>
			<strong>Bất động sản</strong></p>
		<p>
			Kinh doanh bất động sản;<br />
			Đầu tư và phát triển hạ tầng, kinh doanh nhà;<br />
			Kinh doanh dịch vụ bất động sản;<br />
			Kinh doanh khu du lịch sinh thái và khách sạn, nhà hàng.</p>
		<p>
			<strong>Thi công xây lắp</strong></p>
		<p>
			Xây dựng các công trình: công nghiệp, dân dụng, giao thông, thuỷ lợi, thuỷ điện đường dây và trạm biến áp đến 35KV;<br />
			Lắp đặt sửa chữa máy móc, thiết bị cơ khí, điều khiển tự động, điện lạnh, điện kỹ thuật, điện dân dụng, thuỷ khí, thang máy, máy xây dựng, thiết bị nâng hạ;<br />
			Lắp đặt hệ thống máy tính, mạng thông tin liên lạc, viễn thông.</p>
		<p>
			<strong>Sản xuất công nghiệp</strong></p>
		<p>
			Sản xuất kinh doanh điện; kinh doanh máy móc thiết bị;<br />
			Thiết kế, chế tạo máy và thiết bị công nghiệp, tư vấn đầu tư và cung cấp chuyển giao công nghệ cùng các dịch vụ khoa học kỹ thuật có liên quan;<br />
			Sản xuất và kinh doanh vật liệu xây dựng, khai thác đá;<br />
			Sản xuất, mua bán, thi công, lắp đặt, bảo dưỡng, bảo trì hệ thống phòng cháy chữa cháy, camera quan sát, chống đột nhập, chống sét;<br />
			Sản xuất, mua bán linh kiện máy tính, thiết bị thông tin liên lạc, viễn thông.</p>
		<p>
			<strong>Dịch vụ tư vấn</strong></p>
		<p>
			Tư vấn xây dựng: Khảo sát xây dựng, lập dự án và quản lý đầu tư xây dựng; tư vấn đấu thầu, kiểm định chất lượng công trình xây dựng;<br />
			Tư vấn giám sát thi công xây dựng công trình dân dụng và công nghiệp;<br />
			Thiết kế quy hoạch, quy hoạch tổng mặt bằng: đối với công trình xây dựng dân dụng, công nghiệp;<br />
			Thiết kế tổng mặt bằng, kiến trúc, nội, ngoại thất: đối với công trình xây dựng dân dụng, công nghiệp, công trình văn hoá, công trình kỹ thuật hạ tầng đô thị;</p>
		<p>
			<strong>Lĩnh vực khác</strong></p>
		<p>
			Xuất nhập khẩu trang thiết bị, công nghệ, vật tư phục vụ sản xuất và nghiên cứu khoa học công nghệ;<br />
			Các hoạt động khác.</p>
	</div>
