INSERT [dbo].[DoanhNghiepBDS] ([Id], [Ten], [DiaChi], [SoDienThoai], [Email], [Website], [GioiThieu], [AnhDaiDien]) VALUES (9, N'Công ty CP Hỗ trợ Phát triển Công nghệ Detech ', N'Tòa nhà Detech, số 8 Tôn Thất Thuyết, Từ Liêm, Hà Nội.', N'(04) 37689230', N'info@detech.com.vn', N'www.detech.com.vn', N'<div class="content">
	<div class="summary">
		 </div>
	<div class="a1 introinfo">
		<p style="text-align: justify;">
			<strong><span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Công ty CP Hỗ trợ Phát triển Công nghệ Detech tiền thân là doanh nghiệp nhà nước thuộc Viện Khoa học và Công nghệ Quốc gia được thành lập từ năm 1991. Đến nay, Detech đã khẳng định được tên tuổi của mình trên nhiều lĩnh vực.</span></span></strong></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Lĩnh vực kinh doanh chính của <strong>Công ty CP Hỗ trợ Phát triển Công nghệ Detech</strong> là sản xuất lắp ráp xe máy, công nghệ xử lý nước và môi trường, kinh doanh bất động sản. Thành công của công ty luôn gắn liền với những nỗ lực không mệt mỏi của Tổng Giám đốc Đào Văn Tám và các cộng sự - những con người mà xuất phát điểm là khoa học, đam mê kinh doanh.</span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Từ đầu năm 1999, thời điểm nhu cầu sử dụng các phương tiện xe máy của đất nước tăng mạnh, nắm bắt được thị trường Detech đã bắt tay vào lĩnh vực thiết kế, sản xuất phụ tùng, lắp ráp và kinh doanh xe gắn máy. Trên khuôn viên rộng 100 nghìn m2, tại khu công nghiệp Phố Nối, huyện Mỹ Hào, Hưng Yên, nhà máy chế tạo phụ tùng và lắp ráp xe máy Detech được hình thành</span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Tiếp tục khai thác tiềm năng về kỹ thuật công nghệ, Detech đã mở rộng sang hoạt động thiết kế công nghệ, lắp đặt, vận hành các hệ thống xử lí nước ngầm, nước mặt, nước thải, bể sục, đài phun nước,… và là công ty hàng đầu về lĩnh vực này tại Việt Nam. Detech hiện là đại lý của nhiều công ty nổi tiếng thế giới chuyên cung cấp các thiết bị xử lí nước và môi trường như Astra Tây Ban Nha, Prominent Đức, Miox Mỹ, Alcozoh Canada,…</span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Năm 2003, đánh dấu bước ngoặt mới của Detech khi công ty trở thành nhà đầu tư và tư vấn, cung cấp dịch vụ và kinh doanh bất động sản chuyên nghiệp. Hướng đi này là minh chứng cho sự năng động, nhạy bén biết nắm bắt cơ hội để phát triển của người đứng đầu Detech . Từ đó đến nay, Detech đã thành công với hàng loạt các dự án: Khu văn phòng cho thuê tại Mỹ Đình > 8000m2, Dự án khu dân cư Phan Đình Phùng, Túc Duyên tại TP Thái Nguyên, dự án khu dân cư tại Vĩnh Tường Vĩnh Phúc, và dự án khu đô thị mới Đồng Văn - Hà Nam....                                                          </span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Với những thành công trong lĩnh vực bất động sản, Công ty CP bất động sản Detech ra đời trên nền móng vững chắc của Công ty CP Hỗ trợ Phát triển Công nghệ Detech. Với nhiệm vụ chính trước mắt là xây dựng trụ sở làm việc, văn phòng cho thuê toà nhà Detech 17 tầng dự kiến hoàn thiện cuối năm 2009, triển khai thành công dự án Khu công nghiệp tại Nam Định sẽ lấp đầy vào năm 2011. Và hàng loạt các dự án, Phan Đình Phùng 2, Túc Duyên tại Thái Nguyên, Đô Thị Mới Đồng Văn (giai doan 2), Dự án Mê Linh - Vĩnh Phúc, Tổ hợp văn phòng và trung tâm thương mại tại 107 Nguyễn Phong Sắc...</span></span></p>
	</div>
</div>
