INSERT [dbo].[DoanhNghiepBDS] ([Id], [Ten], [DiaChi], [SoDienThoai], [Email], [Website], [GioiThieu], [AnhDaiDien]) VALUES (10, N'C.T Group', N'Tòa nhà C.T Plaza, 60A Trường Sơn, quận Tân Bình, Tp.HCM', N'(08) 62971999', N'info@ctgroupvietnam.com', N'www.ctgroupvietnam.com', N'<div class="content">
	<div class="summary">
		 </div>
	<div class="a1 introinfo">
		<p>
			<strong>Tập đoàn C.T Group được biết đến như biểu tượng của một cộng đồng trẻ trung, năng động và đa dạng. Được thành lập từ năm 1992, với một bước dài giữa hai thế kỷ, Tập đoàn không ngừng lớn mạnh, đồng hành cùng với sự phát triển của Đất nước trong giai đoạn đổi mới và hội nhập với kinh tế toàn cầu.</strong></p>
		<p>
			Từ những ngày đầu tiên thành lập, chỉ với vài người và số vốn ít ỏi, chúng tôi đã vượt qua muôn trùng khó khăn gian khổ, bằng sự quyết tâm, nhẫn nại, sự can trường, lòng dũng cảm, Tập đoàn đã phát triển liên tục, không ngừng nghỉ để trở thành một Tập đoàn với 36 công ty thành viên hùng mạnh.</p>
		<p>
			Ngày nay, những hoạt động kinh doanh trọng điểm của C.T Group tập trung vào các lĩnh vực "nóng" ở Việt Nam: bất động sản, bán lẻ cao cấp, xây dựng, đầu tư tài chính, ẩm thực, giải trí, y tế, giáo dục, đồn điền, khai thác khoáng sản và du lịch sinh thái. Sự kết hợp mang tính chiến lược, đồng bộ tất cả các lĩnh vực kinh doanh chính là chìa khoá đem lại sự thành công cho C.T Group.</p>
		<p>
			Là một Tập đoàn đa ngành dẫn đầu trong việc phát triển mô hình đô thị toàn diện, C.T Group mang trong mình sứ mạng cao cả là đóng góp hết sức mình vào việc xây dựng hình ảnh non song Việt Nam ngày càng tươi đẹp hơn, sánh vai với bạn bè năm châu, xây dựng tiêu chuẩn sống mới cho xã hội.</p>
		<p>
			C.T Group còn mang một sứ mạng hạnh phúc khác là phát triển con người, là cán bộ nhân viên trở thành những người chủ thực sự của Tập đoàn. Hiểu và làm chủ được bản thân, làm chủ được cuộc sống, hạnh phúc về mọi mặt. Qua đó, hướng xã hội xung quanh về cái Thiện, về những điều tốt đẹp…</p>
		<p>
			Phấn đấu xây dựng và phát triển thành biểu tượng của Tập đoàn giàu tính nhân bản, tính cộng đồng, làm chuẩn mực cho mô hình Tập đoàn kiểu mới: Tập đoàn phát triển vì cộng đồng.</p>
	</div>
</div>
