INSERT [dbo].[DoanhNghiepBDS] ([Id], [Ten], [DiaChi], [SoDienThoai], [Email], [Website], [GioiThieu], [AnhDaiDien]) VALUES (11, N'Công ty CP Đầu tư và Xây dựng số 1 Hà Nội ', N'Tầng 1, nhà A6aThành Công, phường Thành Công, quận Ba Đình, Thành phố Hà Nội. ', N'(04) 37727830', N'hicc1@hicc1.com.vn', N'http://www.hicc1.com.vn', N'<div class="content">
	<div class="summary">
		 </div>
	<div class="a1 introinfo">
		<p style="text-align: justify;">
			<strong><span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Công ty CP Đầu tư và Xây dựng số 1 Hà Nội tiền thân là Công ty Xây dựng nhà ở Hà Nội, thành lập năm 1972, trên cơ sở sáp nhập Công ty lắp ghép nhà ở số 1 và số 2.</span></span></strong></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Năm 1993, Công ty được đổi tên thành Công ty Xây dựng số 1 Hà Nội.</span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Tháng 1/2007, Công ty đi vào hoạt động theo mô hình cổ phần và chính thức trở thành <strong>Công ty CP Đầu tư và Xây dựng số 1 Hà Nội</strong> (HICC1). Dưới Công ty là các đơn vị trực thuộc, gồm 7 xí nghiệp, 2 đội xây dựng, Ban quản lý tòa nhà 25 Láng Hạ, Trung tâm tư vấn đầu tư và xây dựng, Trung tâm xuất khẩu lao động và Khách sạn Phương Nam.<br />
			<br />
			<em> </em>HICC1 hoạt động chính trong các lĩnh vực sau:<br />
			<br />
			<strong>Nhận thầu thi công xây dựng</strong></span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Nhận thầu thi công xây dựng công trình dân dụng công nghiệp, hạ tầng kỹ thuật (cấp thoát nước, chiếu sáng), giao thông, thuỷ lợi, thể dục thể thao, công trình văn hoá, vui chơi giải trí, xây lắp đường dây và trạm biến áp dưới 35KV và lắp đặt máy móc thiết bị cho các công trình trên;</span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;"><strong>Tư vấn xây dựng </strong></span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">- Lập, quản lý và thực hiện các dự án đầu tư xây dựng: khu đô thị mới, khu công nghiệp, hạ tầng kỹ thuật, khu dân cư, văn phòng cho thuê và dịch vụ công cộng;<br />
			- Thiết kế lập dự toán các công trình đến nhóm B;<br />
			- Tư vấn soạn thảo hồ sơ mời thầu và đánh giá hồ sơ dự thầu;<br />
			- Tư vấn giám sát thi công và tư vấn quản lý dự án;</span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;"><strong>Các lĩnh vực khác</strong></span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">- Sản xuất và kinh doanh vật liệu xây dựng gồm: Các loại bê tông, gạch không nung và đá ốp lát, các kết cấu gỗ, thép, khung nhôm nhựa phục vụ xây dựng;</span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">- Xuất khẩu lao động;</span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">- Kinh doanh khách sạn và tổ chức các dịch vụ trong khách sạn như: xoa bóp, tắm hơi, nhà hàng ăn uống; Kinh doanh dịch vụ du lịch và lữ hành trong nước và lữ hành quốc tế (không bao gồm kinh doanh phòng hát karaoke, vũ trường, quán bar);</span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">- Mở cửa hàng và làm đại lý kinh doanh vật liệu xây dựng như sắt, thép, xi măng, gạch xây dựng các loại, đồ trang trí nội thất; Buôn bán, thuê và cho thuê máy móc, thiết bị và vật tư chuyên ngành: xây dựng, thể dục thể thao, vui chơi giải trí; Kinh doanh hàng hoá mỹ phẩm và hàng tiêu dùng, kinh doanh rượu (không bao gồm kinh doanh quán bar);</span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">- Kinh doanh bất động sản.</span></span></p>
	</div>
</div>
