				<div class="hide">
					<strong>Điện thoại: </strong>(04) 37727830</div>
				<div class="hide">
					<strong>Email: </strong><a href="mailto:hicc1@hicc1.com.vn" title="">hicc1@hicc1.com.vn</a></div>
				<div class="hide">
					<strong>WebSite: </strong>http://www.hicc1.com.vn</div>
			</td>
		</tr>
	</tbody>
</table>
<p>
	 </p>
