INSERT [dbo].[DoanhNghiepBDS] ([Id], [Ten], [DiaChi], [SoDienThoai], [Email], [Website], [GioiThieu], [AnhDaiDien]) VALUES (12, N'Công ty CP Tập đoàn Nam Cường Hà Nội', N' 70 Linh Lang, Ba Đình, Hà Nội ', N'(04) 37664256', N'info@namcuong.com.vn', N'www.namcuong.com.vn', N'<div class="content">
	<div class="summary">
		 </div>
	<div class="a1 introinfo">
		<p style="text-align: justify;">
			<strong><span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Công ty CP Tập đoàn Nam Cường Hà Nội đã trải qua hơn 20 năm hình thành và phát triển, tập đoàn không ngừng phát triển, khẳng định được vị thế của mình trên thị trường trong nước cũng như quốc tế.</span></span></strong></p>
		<p style="text-align: justify;">
			<strong>Lịch sử hình thành</strong></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Mùa xuân năm 1984, với tên gọi ban đầu là tổ hợp dịch vụ vận tải Xuân Thủy, <strong>Tập đoàn Nam Cường</strong> hoạt động trong lĩnh vực kinh doanh vận tải thủy nội địa các mặt hàng phân bón, xi măng, sắt thép phục vụ cho nhu cầu các tỉnh miền Bắc - Việt Nam.</span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Sau 10 năm hoạt động, tổ hợp dịch vụ vận tải Xuân Thủy được đổi tên thành công ty TNHH Nam Cường vào năm 1994.</span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Năm 1996, công ty được đổi tên thành Công ty TNHH Thương mại và Du lịch Nam Cường.</span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Năm 1998 công ty đổi tên thành Công ty Thương mại và Du lịch Nam Cường.</span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Từ năm 2001, Công ty Thương mại và Du lịch Nam Cường tăng số vốn điều lệ lên 1.111 tỷ đồng, hoạt động theo giấy phép đăng ký số 07020000148, do Sở kế hoạch</span></span> Đ<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">ầu </span></span><span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">tư tỉnh Nam Định cấp.</span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Ngày 25/01/2008, công ty chính thức đổi tên thành Công ty TNHH Tập đoàn Nam Cường.</span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Tháng 8/2009, Công ty TNHH Tập đoàn Nam Cường chính thức đổi tên thành Công ty CP tập đoàn Nam Cường Hà Nội</span></span></p>
		<p>
			<strong>Các dự án đã thực hiện</strong></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Khu đô thị mới Dương Nội - Hà Đông - Hà Nội<br />
			Khu đô thị mới Phùng Khoang - Hà Nội<br />
			Khu đô thị mới Cổ Nhuế - Hà Nội<br />
			Dự án đường trục KTXH Bắc - Tỉnh Hà Tây<br />
			Khu đô thị mới Hòa Vượng - TP Nam Định<br />
			Khu đô thị mới Thống Nhất - TP Nam Định<br />
			Khu Văn hóa Thể thao và Đô thị mơi sphía Đông - TP Hải Dương<br />
			Khu đô thị phía tây - TP Hải Dương</span></span></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Với tiêu chí lấy “Chữ tín” làm phương châm phát triển, Tập đoàn Nam Cường luôn phấn đấu trở thành đối tác tin cậy và hiệu quả trên mọi lĩnh vực từ đầu tư xây dựng dân dụng công nghiệp, khu đô thị mới đến lĩnh vực thương mại du lịch. Những thành công đã đạt được đã tạo nên nền tảng vững chắc cho công ty phát triển thêm nhiều về mọi mặt.</span></span></p>
