INSERT [dbo].[DoanhNghiepBDS] ([Id], [Ten], [DiaChi], [SoDienThoai], [Email], [Website], [GioiThieu], [AnhDaiDien]) VALUES (14, N'Công ty TNHH SX - TM Lan Phương', N' 19 Nguyễn Văn Đậu, P.5, Q.Phú Nhuận, Tp.HCM', N'(08) 38441126', N'info@lanphuongco.com', N'www.lanphuongco.com', N'<div class="content">
	<div class="summary">
		 </div>
	<div class="a1 introinfo">
		<p>
			<strong><span style="font-size:12px;"><span style="font-family: tahoma,geneva,sans-serif;">Công ty TNHH SX-TM Lan Phương được thành lập </span></span><span style="font-family: tahoma, geneva, sans-serif;">lập từ năm 1996 với hơn 14 năm kinh nghiệm kinh doanh trong lĩnh vực thương mại, đầu tư bất động sản, xây dựng nhà, cao ốc, resort. </span></strong></p>
		<p>
			<span style="font-family: tahoma, geneva, sans-serif;">Với mong muốn mang đến những tổ ấm an cư, kiến tạo môi trường sống cho cộng đồng, vươn tới giá trị cho cuộc sống đích thực, tốt đẹp hơn cho mọi người. . . <strong>Công ty Lan Phương </strong>đã xây dựng các công trình lớn như Cao ốc Lan Phương MHBR, Khu dân cư Tam Bình. . .</span></p>
		<p>
			<span style="font-size:12px;"><span style="font-family: tahoma,geneva,sans-serif;">Bên cạnh triết lý kinh doanh đó, Công ty Lan Phương còn ấp ủ hoài bão lớn hơn </span></span><span style="font-family: tahoma, geneva, sans-serif;">khi đầu tư vào một lĩnh vực hoàn toàn mới là Giáo dục và làm chủ đầu tư cho Hệ thống Trường Quốc Tế Việt Anh gồm 2 cấp Mầm non và Tiểu học.</span></p>
		<p>
			<span style="font-size:12px;"><span style="font-family: tahoma,geneva,sans-serif;">Sự lớn mạnh của Công ty Lan Phương ngày hôm nay hoàn toàn nhờ vào sự hợp tác bền bỉ với Quý khách hàng. Chính vì thế, công ty Lan Phương sẽ liên tục tự hoàn thiện mình để có thể đáp ứng mọi yêu cầu của khách hàng một cách tốt nhất và đồng hành cùng Quý khách hàng đi đến thành công.</span></span><br />
			<br />
			<span style="font-family: tahoma,geneva,sans-serif;">Công ty TNHH SX TM Lan Phương là chủ đầu tư 2 dự án cao ốc Lan Phương Plaza và Lan Phương Tower.</span></p>
