	 </div>
<p>
	<strong>Được thành lập vào năm 1995, Gamuda Land là một tập đoàn bất động sản trực thuộc Gamuda Berhad Malaysia. Với 22 năm kinh nghiệm, Gamuda Land chuyên phát triển các khu đô thị và cộng đồng dân cư.</strong></p>
<p>
	Cho đến nay, Gamuda Land đã phát triển hàng loạt các dự án với tổng diện tích khoảng 2.500 ha và tổng giá trị đầu tư lên đến 8,2 tỉ USD. Tiềm lực kinh tế vững mạnh chính là yếu tố giúp Gamuda Land thực hiện thành công các dự án khu đô thị với quy mô lớn tại các thị trường quốc tế. Gamuda Land tự hào áp dụng tiêu chuẩn CONQUAS - hệ thống đánh giá chất lượng công trình được xây dựng và phát triển bởi Cục Quản lý Công trình và Xây dựng Singapore vào các công trình của mình nhằm mang đến sự hài lòng cho khách hàng.</p>
<p>
	Môi trường sống lành mạnh là một trong những tiêu chuẩn quan trọng nhất cho sự phát triển bền vững của cộng đồng, Gamuda Land đặc biệt chú trọng phát triển các khu đô thị mang đến cho cư dân một môi trường trong lành, tiện lợi cũng như nâng tầm chất lượng cuộc sống cho cộng đồng dân cư. Đến nay, Gamuda Land vẫn tiếp tục khẳng định vị thế của mình là nhà phát triển các dự án bất động sản hàng đầu trong khu vực, chú trọng vào chất lượng và mang tâm huyết ấy ra các quốc gia khác.</p>
