INSERT [dbo].[DoanhNghiepBDS] ([Id], [Ten], [DiaChi], [SoDienThoai], [Email], [Website], [GioiThieu], [AnhDaiDien]) VALUES (18, N'Công ty Cổ phần Tập đoàn FLC', N' Tầng 5 - Tòa nhà FLC Landmark Tower, đường Lê Đức Thọ, Mỹ Đình, Từ Liêm, Hà Nội.', N'(04) 37711111', N'info@flc.vn', N'www.flc.vn', N'<div class="content">
	<div class="summary">
		 </div>
	<div class="a1 introinfo">
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;"><span><strong>Được cổ phần hóa năm 2008, Công ty Cổ phần Tập đoàn FLC là sự kết hợp hiệu quả của các đối tác mạnh, đầy tiềm năng trong lĩnh vực đầu tư xây dựng, kinh doanh bất động sản và tài chính.</strong><br />
			<br />
			Sự ra đời của FLC là tâm huyết và nỗ lực hết mình của các cổ đông sáng lập và thành viên hội đồng quản trị, với quyết tâm xây dựng một công ty Việt mang đẳng cấp quốc tế. Bước đi ban đầu là sàn giao dịch bất động sản, tư vấn đầu tư, và tư vấn tài chính doanh nghiệp, hiện FLC đang bắt đầu triển khai hoạt động đầu tư vào lĩnh vực bất động sản.<br />
			<br />
			Định hướng phát triển của FLC là trở thành một công ty mạnh và năng động, lấy hoạt động đầu tư và kinh doanh bất động sản, đầu tư tài chính và khai thác khoáng sản làm trọng điểm. Để thực hiện được mục tiêu này, FLC đã và đang tập trung đầu tư vào các cơ hội tăng trưởng đa dạng, tận dụng lợi thế và sức mạnh của các đơn vị thành viên; tạo nguồn cung cổ phiếu chất lượng cao cho thị trường chứng khoán; kết nối với các nhà đầu tư nước ngoài để tăng cường và đa dạng hoá năng lực; cung cấp các dịch vụ hoàn hảo, đáp ứng nhu cầu của các doanh nghiệp, cá nhân trong và ngoài nước; phát triển nguồn nhân lực thông qua việc xây dựng một môi trường làm việc năng động với những cơ hội phát triển cho từng cá nhân; hoàn thiện các sản phẩm - dịch vụ cũng như đội ngũ nhân viên chuyên nghiệp, kinh nghiệm, đặt nền tẳng cho sự phát triển bền vững.<br />
			<br />
			Song song với việc hoạt động và phát triển vị thế tại thị trường nội địa, FLC sẽ hướng tới thị trường quốc tế và đặt mục tiêu xây dựng mối quan hệ, hợp tác bền vững với các đối tác nước ngoài.<br />
			<br />
			Động lực của FLC là phát huy yếu tố con người, đặt con người vào vị trí trung tâm, doanh nghiệp làm môi trường để con người phát huy tài năng sáng tạo, xây dựng và đào tạo đội ngũ làm việc có hiệu quả, khẳng định phong cách văn hoá doanh nghiệp FLC; nỗ lực xây dựng FLC trở thành một tập đoàn lớn và chủ đạo trên thị trường trong nước và có khả năng cạnh tranh trên thị trường quốc tế.</span></span></span></p>
	</div>
