INSERT [dbo].[DoanhNghiepBDS] ([Id], [Ten], [DiaChi], [SoDienThoai], [Email], [Website], [GioiThieu], [AnhDaiDien]) VALUES (19, N'Công ty CP Đầu tư Dịch vụ Tài chính Hoàng Huy ', N'Số 116 Nguyễn Đức Cảnh, quận Lê Chân, TP. Hải Phòng', N'(031) 3610021', N'admin@hoanghuy.com.vn', N'www.hoanghuy.com.vn', N'<div class="content">
	<div class="summary">
		 </div>
	<div class="a1 introinfo">
		<p style="text-align: justify;">
			<strong>Công ty CP Đầu tư Dịch vụ Tài chính Hoàng Huy được thành lập theo Giấy phép kinh doanh số 0200117929, được cấp ngày 25/12/2007. Công ty hoạt động chủ yếu trong lĩnh vực đầu tư xây dựng các công trình, dự án bất động sản.</strong></p>
		<p style="text-align: justify;">
			<span style="font-size: 12px;"><span style="font-family: tahoma,geneva,sans-serif;">Năm 1999,<strong> Tập đoàn Hoàng Huy </strong>đầu tư xây dựng nhà máy I tại 345 Trần Nguyên Hãn - Hải Phòng với diện tích 30.000m2, có quy mô công nghiệp với 4 dây chuyền thiết bị hiện đại chuyên sản xuất và lắp ráp xe máy tại trong nội thành Hải Phòng, với sản lượng ban đầu là 35.000 xe máy/ năm và hiện nay đã nâng lên 50.000 xe máy/ năm.<br />
			<br />
			Năm 2002, Tập đoàn đầu tư tư xây dựng nhà máy II tại Km9 Đường 5 mới - Nam Sơn - An Dương -HP và Showroom với diện tích 100.000 m2, chuyên sản xuất động cơ và lắp ráp xe máy với công suất 100.000 xe/năm.<br />
			<br />
			 Năm 2003, Tập đoàn mở rộng mặt bằng sản xuất đầu tư dây chuyền lắp ráp xe tải và các xe chuyên dụng khác với công xuất trên 500 xe/tháng và nhà máy đáp ứng được các tiêu chuẩn 115/2004/QĐ-BCN của Bộ Công nghiệp ngay từ những ngày đầu tiên.<br />
			<br />
			 Năm 2006, Tập đoàn đầu tư xây dựng dự án chung cư cao tầng 275 Nguyễn Trãi với diện tích 24.000m2 tại Trung tâm thành phố Hà Nội, đây là dự án do nhà nước cấp phép xây dựng. Tập đoàn đã giao cho Công ty Cổ phần Hưng Việt chuyên kinh doanh bất động sản và địa ốc triển khai.<br />
			<br />
			Năm 2007, Tập đoàn xây dựng toà nhà 11 tầng trụ sở công ty và Văn phòng cho thuê tại 116 Nguyễn Đức Cảnh ngay chính giữa trung tâm Tp. Hải Phòng.<br />
			<br />
			Đầu năm 2007, Tập đoàn thành lập Văn phòng đại diện tại địa chỉ 183 Bà Triệu, Tp. Hà Nội. Đây là nơi giao dịch và là Showroom các sản phẩm ôtô du lịch nhập khẩu của Tập đoàn. Cuối năm 2007 Văn phòng này đã phát triển thành Công ty con trực thuộc tập đoàn (Công ty CP đầu tư Hoàng Huy).<br />
			<br />
			Mục tiêu phát triển của Tập đoàn năm 2009 đã được xác định là: Hoàng Huy sẽ xây dựng 2 trung tâm  thương mại  lớn ở Hải Phòng và  Hà Nội<br />
			<br />
			Sau năm 2009, Tập đoàn Hoàng Huy sẽ tiếp tục phát triển cơ sở vật chất kỹ thuật của mình, nâng cao năng lực các nhà máy để sản xuất được các loại xe kỹ thuật cao phục vụ trong nước và xuất khẩu, đặc biệt Tập đoàn  muốn  hợp tác với các tập đoàn lớn của nước ngoài để mở rộng và chiếm lĩnh được các thị trường  trong nước mà Hoàng Huy đang hướng tới.</span></span></p>
	</div>
</div>
