INSERT [dbo].[DoanhNghiepBDS] ([Id], [Ten], [DiaChi], [SoDienThoai], [Email], [Website], [GioiThieu], [AnhDaiDien]) VALUES (20, N'Công ty CP Tập đoàn Địa ốc Cát Tường ', N'Số 789 Ấp Mới 1, xã Mỹ Hạnh Nam, huyện Đức Hòa, tỉnh Long An ', N'02723717070', N'info@cattuonggroup.com.vn', N'www.cattuonggroup.com.vn', N'<div class="content">
	<div class="summary">
		 </div>
	<div class="a1 introinfo">
		<p>
			<strong>Công ty CP Tập đoàn Địa ốc Cát Tường được thành lập vào năm 2011 ngay giữa tâm bão của thị trường bất động sản (BĐS) khi hầu hết các dự án BĐS nằm trong tình trạng đóng băng, ngân hàng siết chặt tín dụng…</strong></p>
		<p>
			Dù xác định mục tiêu kinh doanh đáp ứng nhu cầu thực của khách hàng có thu nhập trung bình nhưng Cát Tường Group vẫn vấp phải nhiều khó khăn về tài chính, nhân sự, thị trường…</p>
		<p>
			Những khó khăn thách thức không làm vơi đi ý chí kiên định đầy nghị lực của những người sáng lập và các cộng sự. Ban lãnh đạo công ty đã mạnh dạn đổi mới phương pháp quản lý, triển khai nghiên cứu thị trường một cách quy mô - bài bản, từ đó có những chính sách tiếp cận khách hàng phù hợp nhất. Chữ tín luôn được đặt lên hàng đầu, xác định khách hàng là trung tâm, tập trung phát triển chính sách bán hàng tối ưu, sản phẩm chất lượng, pháp lý minh bạch và dịch vụ hậu mãi chu đáo… với phương châm Cát Tường Group không chỉ bán nhà mà mang đến cho khách hàng một giải pháp an cư, đầu tư hợp lý nhất. Đó cũng chính là nền móng vững chắc để công ty tồn tại và vượt qua thời điểm nhạy cảm của thị trường với uy tín và tiềm lực tài chính không ngừng lớn mạnh.</p>
		<p>
			Hiện tại, Cát Tường Group sở hữu hơn 1.500 nhân viên chính thức, 10 khối sàn giao dịch hoạt động tại Long An và Tp.HCM, cùng các công ty thành viên, bao gồm:</p>
		<p>
			- Công ty CP Địa ốc Mỹ Hạnh Đức Hòa<br />
			- Công ty CP Địa ốc Cát Tường Thảo Nguyên<br />
			- Công ty CP Đầu tư Thương mại Xây dựng Mỹ Đức Long An</p>
		<p>
			Doanh nghiệp hoạt động chuyên nghiệp trong các lĩnh vực: Đầu tư, kinh doanh, xây dựng, phân phối, tiếp thị các sản phẩm BĐS, cung cấp giải pháp tài chính, tư vấn thiết kế, cung cấp vật liệu xây dựng…</p>
		<p>
			Trong chiến lược phát triển 5 năm tới, Cát Tường Group tiếp tục tập trung phát triển đất nền và nhà phố phân khúc từ khá trở lên “Trở thành doanh nghiệp hàng đầu trong lĩnh vực BĐS tại tỉnh Long An và vươn ra toàn quốc”. Từ năm 2019 đến năm 2024 mỗi năm Cát Tường Group sẽ cung cấp ra thị trường từ 5.000-6.000 sản phẩm. Ngoài ra, Cát Tường Group cũng chú trọng đầu tư vào lĩnh vực BĐS công nghiệp, văn phòng cho thuê, du lịch nghỉ dưỡng, khách sạn - resort…</p>
