	<div class="summary">
		 </div>
	<div class="a1 introinfo">
		<p>
			<strong>Công ty CP Đầu tư & Phát triển Bất động sản TNR Holdings Việt Nam (TNR Holdings) là thành viên của Tập đoàn Đầu tư TNG - một trong những tập đoàn kinh tế tư nhân đa ngành hàng đầu Việt Nam với hơn 20 năm hoạt động trên những lĩnh vực đầu tư phát triển khu công nghiệp.</strong></p>
		<p>
			Với danh mục hoạt động đa dạng gồm: dự án thương mại và khu nghỉ dưỡng, dự án khu dân cư, TNR Holdings hướng đến phát triển bền vững và chuyên nghiệp trong lĩnh vực Đầu tư - Quản lý - Phát triển các dự án bất động sản trải rộng khắp Việt Nam.</p>
		<p>
			<strong>Sứ mệnh</strong></p>
		<p>
			Nâng tầm chất lượng cuộc sống cho người Việt bằng các sản phẩm giá trị, hiện đại, sáng tạo và dẫn đầu xu hướng.</p>
		<p>
			<strong>Tầm nhìn</strong></p>
		<p>
			Trở thành tập đoàn đầu tư xây dựng BĐS và du lịch nghỉ dưỡng thuộc Top đầu tại Việt Nam, hướng tới trở thành tập đoàn danh tiếng trong khu vực Đông Nam Á và Châu Á – Thái Bình Dương. Mang đến các sản phẩm với chất lượng “Vàng” đúng như tên gọi đều được bắt đầu bằng chữ "GOLD" của các dự án mà TNR Holdings phát triển.</p>
		<p>
			<strong>Mục tiêu</strong></p>
		<p>
			Cung cấp 20.000 căn hộ cao cấp cùng 160.000m2 diện tích văn phòng bán/cho thuê tại thị Hà Nội, TP. Hồ Chí Minh trong vòng 2 năm 2015-2017.</p>
		<p>
			<strong>Giá trị cốt lõi</strong></p>
		<p>
			Chuyên nghiệp<br />
			Chất lượng<br />
			Bền vững</p>
