INSERT [dbo].[DoanhNghiepBDS] ([Id], [Ten], [DiaChi], [SoDienThoai], [Email], [Website], [GioiThieu], [AnhDaiDien]) VALUES (24, N'Tổng công ty 319 - Bộ Quốc Phòng', N'Số 63 Lê Văn Lương - Trung Hòa - Cầu Giấy - Hà Nội', N'04.38 319 319 - 04.38 274 209', N'banbientap319@gmail.com', N'http://319.com.vn/lien-he.html', N'<p>
	Tổng công ty 319 tiền thân là Sư đoàn 319/Quân khu 3, thành lập ngày 07/03/1979 theo Quyết định số 231/QĐ-QP của Bộ Quốc phòng. Nhiệm vụ được giao khi mới thành lập là lực lượng cơ động, huấn luyện quân dự nhiệm và chiến sỹ mới bổ sung cho các đơn vị làm nhiệm vụ bảo vệ biên giới phía Bắc của Tổ quốc và tăng cường cho các đơn vị trên địa bàn Quân khu 3. Thực hiện Nghị quyết số 27, ngày 26/06/1980 của Bộ Chính trị về Quân đội thực hiện nhiệm vụ xây dựng kinh tế, ngày 27/09/1980, Bộ trưởng Bộ Quốc phòng ra Quyết định số 579/QĐ-QP chuyển nhiệm vụ của Sư đoàn 319 từ lực lượng cơ động, huấn luyện quân sự sang nhiệm vụ xây dựng kinh tế, đổi tên thành Công ty xây dựng 319 với các chức năng thi công xây lắp các công trình công nghiệp, dân dụng, sản xuất và cung cấp sản phẩm công nghiệp phục vụ Quốc phòng và dân dụng.</p>
<p>
	     Thực hiện kế hoạch sắp xếp, đổi mới doanh nghiệp trong Quân đội giai đoạn 2008 - 2010 của Chính phủ, ngày 04/03/2010, Bộ trưởng Bộ Quốc phòng ra quyết định số 606/QĐ-BQP chuyển Công ty xây dựng 319 thành Công ty trách nhiệm hữu hạn một thành viên 319 hoạt động theo hình thức Công ty mẹ - Công ty con; với 25 ngành nghề sản xuất, kinh doanh, quy mô hoạt động trên toàn quốc và mở rộng địa bàn sang các nước khu vực Đông Nam Á, Công ty TNHH MTV 319 ngày càng khẳng định được uy tín, vị thế và thương hiệu của mình.</p>
<p>
	     Thực hiện Công văn số 1455/TTg-ĐMDN, ngày 19/08/2011 của Thủ tướng Chính phủ về việc thành lập các Tổng công ty hoạt động theo hình thức Công ty mẹ - Công ty con trên cơ sở tổ chức lại các Công ty TNHH một thành viên thuộc Bộ Quốc phòng, ngày 23/08/2011, Bộ trưởng Bộ Quốc phòng đã ký quyết định số 3037/QĐ-BQP thành lập Tổng công ty 319, hoạt động theo hình thức Công ty mẹ - Công ty con trên cơ sở tổ chức lại Công ty TNHH MTV 319; tiếp đó ngày 10/12/2011 Bộ trưởng Bộ Quốc phòng ký quyết định số 4798/QĐ-BQP hợp nhất 7 đơn vị: Xí nghiệp 7, Xí nghiệp 19, Xí nghiệp 359, Xí nghiệp 487, Xí nghiệp Vạn Chánh, Xí nghiệp TK 21, Công ty Sông Hồng thuộc Tổng công ty 319 thành Công ty TNHH một thành viên Duyên Hải trực thuộc Tổng công ty 319. Đồng thời Bộ trưởng Bộ Quốc phòng ký quyết định 4799/QĐ-BQP điều chuyển Tổng công ty 319 về trực thuộc Bộ Quốc phòng, Công ty TNHH một thành viên Duyên Hải trực thuộc Quân khu 3; Quân ủy Trung ương ra quyết định số 561-QĐ/QUTW ngày 26/12/2011 điều chuyển Đảng bộ Tổng công ty 319 về trực thuộc Quân ủy Trung ương. Hiện nay, Tổng công ty có 12 phòng chức năng, 07 Công ty TNHH một thành viên, 06 Công ty cổ phần do Tổng công ty nắm cổ phần chi phối, 09 Xí nghiệp, Chi nhánh thành viên, 07 Ban Quản lý Dự án thực hiện chức năng đại diện Chủ đầu tư, 05 Ban điều hành xây lắp, 03 Công ty liên kết với 38 ngành nghề sản xuất, kinh doanh. Địa bàn hoạt động khắp các tỉnh, thành trong cả nước.</p>
<p>
	     Trải qua hơn 37 năm xây dựng, đổi mới và phát triển, dưới sự lãnh đạo, chỉ đạo của Quân ủy Trung ương, Thủ trưởng Bộ Quốc phòng; sự tạo điều kiện, giúp đỡ của các cơ quan chức năng Bộ Quốc phòng và các Bộ, ngành TW, các địa phương, doanh nghiệp trong và ngoài Quân đội; phát huy truyền thống “Đoàn kết, chủ động, sáng tạo, quyết thắng” - Đơn vị “Anh hùng lao động” trong thời kỳ đổi mới, các thế hệ lãnh đạo, chỉ huy đơn vị đã năng động sáng tạo, nỗ lực khắc phục khó khăn cùng với ý chí phấn đấu vươn lên của cán bộ, công nhân viên và người lao động, Tổng công ty 319 luôn hoàn thành xuất sắc nhiệm vụ được giao; doanh thu, lợi nhuận năm sau cao hơn năm trước, thực hiện đầy đủ nghĩa vụ với ngân sách Nhà nước và Bộ Quốc phòng tạo việc làm và nâng cao thu nhập, ổn định đời sống cho trên 6.000 cán bộ, công nhân viên, người lao động.</p>
<p>
	     Tích cực tham gia các Cuộc vận động, các phong trào “Đền ơn, đáp nghĩa”, “Uống nước nhớ nguồn”, “Xóa đói, giảm nghèo”, “Quân đội chung sức xây dựng nông thôn mới”… do các cấp, các ngành, các địa phương phát động. Hàng năm quyên góp, trích quỹ phúc lợi ủng hộ các hoạt động và hỗ trợ cán bộ, công nhân viên trong đơn vị từ 1,2 đến 1,5 tỷ đồng. Những năm gần đây Tổng công ty đã tích cực vận động quyên góp và trích quỹ phúc lợi xây tặng  mỗi năm từ 5 - 10 căn “Nhà tình nghĩa”, “Nhà đồng đội” cho các đối tượng chính sách xã hội và cán bộ các đơn vị quân đội có hoàn cảnh khó khăn về nhà ở.</p>
<p>
	     Với truyền thống đoàn kết, bề dày thành tích, kinh nghiệm, uy tín và thương hiệu của mình; cùng với sự tin tưởng, ủng hộ của lãnh đạo các Bộ, Ngành, địa phương và sự hợp tác có hiệu quả của các đối tác , quý khách hàng, chúng tôi tin tưởng Tổng công ty 319 - Bộ Quốc phòng sẽ giành nhiều thành tích xuất sắc hơn nữa, không ngừng “Vươn tới tầm cao”, góp phần thực hiện thắng lợi mục tiêu “Dân giàu, nước mạnh, dân chủ, công bằng, văn minh”!</p>
<p>
	 </p>
<p>
	<img alt="" border="0" src="http://319.com.vn/images/DSC_0505.JPG" /></p>
<p>
	<img alt="" border="0" src="http://319.com.vn/images/gioithieu/in 60x901.jpg" /></p>
<p>
	 </p>
<p>
	 </p>
<p>
	<img alt="" border="0" height="487" src="http://319.com.vn/images/5 dinh huong 1 tam nhin1.jpg" width="651" /></p>
', N'/Content/Images/AnhDaiDienDuAn/07122019-no-photo-available-300x225.png')
