INSERT [dbo].[DuAn] ([Id], [TenDuAn], [DiaChi], [GiaTu], [ChuDauTu], [TongDienTich], [TienDoDuAn], [LoaiDuAnId], [QuyMoDuAn], [GioiThieuDuAn], [ViTri], [HaTang], [ThietKe], [MatBang], [Media], [HoTroTaiChinh], [TinhThanhPhoId], [QuanHuyenId], [SoSanPham], [AnhDaiDien], [NguoiDangId], [TrangThai], [NgayDang], [DoanhNghiepBDSId]) VALUES (2, N'Căn hộ Define', N' Đường Đặng Như Mai, Phường Thạnh Mỹ Lợi, Quận 2, Hồ Chí Minh', 500000000.0000, N'Tập đoàn CapitaLand', 4000, N'Thời gian bàn giao: Quý 2/2022', 1, N'Cao 24 tầng, 88 căn', N'<div class="prj-noidung a1">
	<h2>
		<strong>Thông tin tổng quan dự án Căn hộ Define </strong></h2>
	<p>
		<strong>Căn hộ Define Quận 2</strong> được chủ đầu tư Capitaland triển khai với quy mô gồm 1 tòa tháp cao 24 tầng với số lượng sản phẩm giới hạn - chỉ 88 căn hộ hạng sang với thang máy sử dụng riêng, đảm bảo tính riêng tư cho các chủ nhân tương lai của dự án.</p>
	<p>
		Được biết, Define cũng là dự án đầu tiên và duy nhất tại Việt Nam hiện có hồ bơi riêng trong từng căn hộ và mỗi căn hộ này đều sở hữu view đẹp hướng ra sông Sài Gòn thơ mộng.  </p>
	<p>
		- Tên dự án: Define<br />
		- Chủ đầu tư: CapitaLand<br />
		- Vị trí: đường Đặng Như Mai, Thạnh Mỹ Lợi, Quận 2, Tp.HCM<br />
		- Diện tích khu đất: 4.000m2<br />
		- Quy mô: Cao 24 tầng, 88 căn<br />
		- Số căn/sàn: 4 căn<br />
		- Số thang máy: 6<br />
		- Diện tích:<br />
		+ Căn 3 phòng ngủ: 194m2 có sân vườn<br />
		+ Căn 4 phòng ngủ: 294m2 có hồ bơi riêng 26m2<br />
		- Thời gian bàn giao: Quý 2/2022</p>
	<p style="text-align: center;">
		<em><img alt="" src="https://file4.batdongsan.com.vn/2019/11/15/hmcVYWuR/20191115135940-3c82.jpg" style="width: 550px; height: 309px;" /><br />
		Phối cảnh tổng thể dự án Căn hộ Define</em></p>
</div>
<p>
	 </p>
', N'<div class="prj-noidung a1">
	<p>
		<strong>Dự án Define</strong> nằm trên đường Đặng Như Mai, phường Thạnh Mỹ Lợi, Quận 2, Tp.HCM. Dự án sở hữu vị thế vô cùng đắc địa khi nằm song song với sông Sài Gòn và có mặt sau view toàn cảnh thành phố.</p>
	<p style="text-align: center;">
		<em><img alt="" src="https://file4.batdongsan.com.vn/2019/11/15/hmcVYWuR/20191115150644-6979.jpg" style="width: 550px; height: 290px;" /><br />
		Vị trí dự án Căn hộ Define</em></p>
</div>
<p>
	 </p>
', N'<div class="prj-noidung a1">
	<p>
		<strong>Căn hộ Define</strong> là một dự án hạng sang nên tất cả những tiện ích được phát triển tại đây cũng có chất lượng xứng tầm đẳng cấp của dự án:</p>
	<p>
		- Bãi đậu xe áp dụng công nghệ thông minh và đảm bảo mỗi căn hộ sở hữu 2 chỗ đậu xe<br />
		- 20 chỗ đậu xe dành cho siêu xe thể thao và siêu moto<br />
		- Sảnh đón khách tiêu chuẩn 6 sao<br />
		- Trường mầm non, khu vui chơi trẻ em<br />
		- Căn hộ 3 PN có sân vườn riêng<br />
		- Căn hộ 4 PN có hồ bơi rộng 26m2<br />
		- Rạp hát ngoài trời<br />
		- Công viên cây xanh và cảnh quan<br />
		- Đường chạy bộ<br />
		- Trung tâm thương mại</p>
	<p style="text-align: center;">
		<em><img alt="" src="https://file4.batdongsan.com.vn/2019/11/15/hmcVYWuR/20191115144947-87b5.jpg" style="width: 550px; height: 385px;" /><br />
		Hồ bơi riêng tại căn hộ</em></p>
	<p style="text-align: center;">
