INSERT [dbo].[DuAn] ([Id], [TenDuAn], [DiaChi], [GiaTu], [ChuDauTu], [TongDienTich], [TienDoDuAn], [LoaiDuAnId], [QuyMoDuAn], [GioiThieuDuAn], [ViTri], [HaTang], [ThietKe], [MatBang], [Media], [HoTroTaiChinh], [TinhThanhPhoId], [QuanHuyenId], [SoSanPham], [AnhDaiDien], [NguoiDangId], [TrangThai], [NgayDang], [DoanhNghiepBDSId]) VALUES (5, N'Hà Đô Riverside ', N'Đường Lê Thị Riêng, Quận 12, Hồ Chí Minh', 500000000.0000, N'Tập đoàn Hà Đô', 3773, N'Đang cập nhật', 1, N'Quy mô căn hộ: 256 căn', N'<div class="prj-noidung a1">
	<h2>
		<strong>Thông tin tổng quan dự án Hà Đô Riverside</strong></h2>
	<p>
		<strong>Hà Đô Riverside</strong> là dự án căn hộ do Tập đoàn Hà Đô làm chủ đầu tư với thiết kế đặc biệt, hướng tới xu hướng sinh thái xanh, mang đến môi trường sống “xanh” cho các cư dân tương lai.</p>
	<p>
		Với vị trí đẹp trên đường Lê Thị Riêng, nằm trong KDC Thới An Hà Đô, Căn hộ Hà Đô Riverside gồm 15 tầng gồm 13 tầng căn hộ, 2 tầng thương mại với 256 căn hộ hiện đại. Hai tòa nhà tại dự án được thiết kế theo hình khối Block so le, giúp  tất cả các căn hộ đều được thông gió và đón được gió, ánh sáng tự nhiên, hứa hẹn sẽ là biểu tượng mới cho sự thịnh vượng, một chốn an cư lý tưởng cho người có thu nhập trung bình tại quận 12.</p>
	<p>
		- Tên dự án: Hà Đô RiverSide <br />
		- Chủ đầu tư: Tập Đoàn Hà Đô - HaDo Group<br />
		- Đơn vị xây dựng dự án: Hà Đô<br />
		- Diện tích khu đất: 3.772,5m2<br />
		- Mật độ xây dựng: 30,53%<br />
		- Diện tích xây dựng: 1.509m2<br />
		- Tổng diện tích sàn: 18.350m2<br />
		- Không gian xanh: 765,4m2<br />
		- Quy mô: 15 tầng (2 tầng thương mại và 13 tầng căn hộ)<br />
		+ Tầng 1, tầng 2: khu để xe và shophouse thông tầng<br />
		+ Tầng 3-15: tầng căn hộ<br />
		- Quy mô căn hộ: 256 căn:<br />
		+ Căn hộ shophouse: diện tích từ 90,95-116,87m2<br />
		+ Căn hộ tiêu chuẩn: diện tích từ 48,43-56,53m2 thiết kế từ 1,5-2 phòng ngủ</p>
	<p style="text-align: center;">
		<em><img alt="" src="https://file4.batdongsan.com.vn/2019/10/29/hmcVYWuR/20191029135149-ef80.jpg" style="width: 550px; height: 481px;" /><br />
		Phối cảnh tổng thể dự án Hà Đô Riverside</em></p>
</div>
<p>
	 </p>
', N'<div class="prj-noidung a1">
	<p>
		<strong>Hà Đô Riverside</strong> nằm trên đường Lê Thị Riêng, thuộc khu trung tâm hành chính quận 12, gần QL1A, gần sông Vàm Thuật, rất thuận lợi cho kết nối cả đường thủy và đường bộ.</p>
	<p style="text-align: center;">
		<em><img alt="" src="https://file4.batdongsan.com.vn/2019/10/29/hmcVYWuR/20191029152717-a3fd.jpg" style="width: 550px; height: 445px;" /><br />
		Vị trí dự án Hà Đô Riverside</em></p>
</div>
<p>
	 </p>
', N'<div class="prj-noidung a1">
	<p>
		Dự án kết nối về trung tâm thông qua các nút giao thông quan trọng như: nút hầm chui An Sương, ngã 6 Gò Vấp; cầu vượt Quang Trung và trong tương lai là Cầu bắt qua sông Vàm Thuật.</p>
	<p>
		Ngoài ra từ vị trí dự án, cư dân có thể di chuyển đến các tỉnh lân cận như: Tây Ninh, các tỉnh Miền Tây, Bình Dương, Đồng Nai… thông qua quốc lộ 1A; quốc lộ 22….</p>
	<p>
		Tiện ích Nội khu căn hộ hà đô riverside quận 12 thới an</p>
	<p>
		Căn hộ hà đô riverside chú trọng trong từng đường nét thiết kế nhằm mang lại không gian sống thoải mái và thoáng đãng cùng với đầy đủ các tiện ích hoàn hảo như: Hồ bơi, Công viên, Đường chạy, Sân tennis, Spa, Phòng sinh hoạt cộng đồng, Khu thể thao ngoài trời…Giúp gia chủ có thể tận hưởng trọn vẹn một cuộc sống đẳng cấp và tiện nghi.</p>
	<p>
		Với vị trí thuận lợi cùng thiết kế thông minh, Hà Đô Riverside thừa hưởng rất nhiều tiện ích trong khuôn viên dự án Khu đô thị Hà Đô Thới An. Bên cạnh đó, nhờ cơ sở hạ tầng khu vực phát triển đồng bộ, việc kết nối với các tiện ích ngoại khu cũng trở nên dễ dàng hơn với cư dân Hà Đô Riverside.</p>
	<p>
		Hệ thống trường học từ mầm non đến đại học phủ dày đặc xung quanh khu vực dự án. Hơn 12 trường đại học cao đẳng trong 11 phường của quận 12.</p>
	<p>
		Hệ thống các trung tâm mua sắm, siêu thị, chợ hiện hữu trong bán kính 2km trở lại khu vực dự án. Chợ đầu mối, cung cấp những thực phẩm tươi sống và rẻ đến từng nhà của cư dân Hà Đô Riverside.</p>
	<p>
		Tại Hà Đô Riverside, những đứa trẻ được lớn lên trong một cộng đồng tri thức, được tiếp cận với những hoạt động vui chơi giải trí bổ ích, và sống trong một môi trường thiên nhiên yên lành, điều mà bất cứ bậc Cha Mẹ nào cũng mong ước.</p>
	<p>
		Tiện ích ngoại khu căn hộ hà đô riverside quận 12 thới an</p>
	<p>
		- Cách UBND Q12 chỉ 5 phút<br />
		- Cách Metro Hiệp Phú chỉ 5 phút<br />
		- Cách phần mềm Quang Trung chỉ 10 phút<br />
		- Cách ĐH Hoa Sen – Fpt - GTVT chỉ 10 phút<br />
		- Cách Chợ Thạnh Đông Tây chỉ 10 phút<br />
		- Cách Coopmart Q12 – Nguyễn Ảnh Thủ chỉ 10 phút<br />
		- Cách Bệnh viện Q12 chỉ 10 phút<br />
		- Cách Trung Tâm thể dục thể thao Q12 chỉ 10 phút</p>
</div>
<p>
	 </p>
', N'<p>
	<img id="TopContent_ProjectDetail1_ctl00_imgOveralView" src="https://file4.batdongsan.com.vn/resize/658x579/2019/10/29/hmcVYWuR/20191029142157-db41.jpg" style="width:658px;" /></p>
', N'<p>
	<img class="mapster" src="https://file4.batdongsan.com.vn/resize/658x-/2019/10/29/hmcVYWuR/20191029142212-0ce4.jpg" style="border: 0px none; position: absolute; left: 0px; top: 0px; padding: 0px; opacity: 0;" usemap="#imgOveralFlat4286" /></p>
<p>
