', N'<p>
	<img class="lg-object lg-image" src="https://file4.batdongsan.com.vn/2019/10/29/hmcVYWuR/20191029142513-b1af.jpg" /></p>
<p>
	<img class="lg-object lg-image" src="https://file4.batdongsan.com.vn/2019/10/29/hmcVYWuR/20191029142521-c3ac.jpg" /></p>
<p>
	<img class="lg-object lg-image" src="https://file4.batdongsan.com.vn/2019/10/29/hmcVYWuR/20191029142529-0844.jpg" /></p>
