<p>
	<strong>Oriental Sun Tower </strong>là dự án Tổ hợp văn phòng, trung tâm thương mại và dịch vụ đẳng cấp do Tập đoàn BRG danh tiếng làm chủ đầu tư. Tọa lạc trên khu đất quy hoạch rộng 6.500m2, Oriental Sun Tower đang là một trong số ít những dự án cao ốc văn phòng sở hữu vị trí "vàng" tại khu vực trung tâm Hà Nội.</p>
<p>
