	<em>Phối cảnh tổng thể dự án Oriental Sun Tower</em></p>
', N'<p>
	<strong>Oriental Sun Tower</strong> tọa lạc tại số 198 Trần Quang Khải, quận Hoàn Kiếm, Hà Nội.</p>
', N'<div class="prj-noidung a1">
