INSERT [dbo].[DuAn] ([Id], [TenDuAn], [DiaChi], [GiaTu], [ChuDauTu], [TongDienTich], [TienDoDuAn], [LoaiDuAnId], [QuyMoDuAn], [GioiThieuDuAn], [ViTri], [HaTang], [ThietKe], [MatBang], [Media], [HoTroTaiChinh], [TinhThanhPhoId], [QuanHuyenId], [SoSanPham], [AnhDaiDien], [NguoiDangId], [TrangThai], [NgayDang], [DoanhNghiepBDSId]) VALUES (7, N'Detech Tower II', N'107 Đường Nguyễn Phong Sắc, Phường Dịch Vọng Hậu, Cầu Giấy, Hà Nội', 0.0000, N'Công ty CP Hỗ trợ Phát triển Công nghệ Detech', 0, N'1103', 2, N'17 tầng văn phòng và 3 tầng hầm', N'<div class="prj-noidung a1">
	<h2>
		<strong>Thông tin </strong><strong>dự án Detech Tower II</strong></h2>
	<p>
		<strong>Detech Tower II</strong> là dự án tòa văn phòng hạng B được xây dựng với kiến trúc hiện đại gồm 17 tầng văn phòng và 3 tầng hầm. Không chỉ sở hữu vị trí đắc địa của Quận Cầu Giấy với giao thương thuận tiện, dự án còn có chất lượng xây dựng vượt trội, đáp ứng tốt nhu cầu thuê văn phòng đa dạng của các doanh nghiệp khi được trang bị đầy đủ các tiện nghi hiện đại, cung cấp không gian làm việc chuyên nghiệp cho mọi khách thuê.</p>
	<div>
		Tọa lạc trên khu đất quy hoạch rộng 1,103m2 với tổng diện tích sử dụng 14.299m2, Tổ hợp văn phòng Detech Tower II sẽ là sự lựa chọn hàng đầu cho các doanh nghiệp đang có nhu cầu thuê diện tích vừa và nhỏ làm văn phòng nhưng vẫn đảm bảo tối ưu hóa khả năng làm thương hiệu, khẳng định hình ảnh của công ty với ngân sách vừa phải.</div>
	<div>
		 </div>
	<div>
		Tính đến quý I/2018, sau 13 tháng thi công, hiện dự án đã hoàn thành 100% phần thô và dự kiến trong quý IV/2018 sẽ hoàn thiện, đưa vào sử dụng. </div>
	<div>
		<div>
			 </div>
		<div>
			- Tên dự án:<span style="white-space:pre"> </span>Tòa nhà văn phòng Detech Tower II<br />
			- Chủ đầu tư:<span style="line-height: 25.2px; white-space: pre;"> </span>Công ty CP Hỗ trợ và Phát triển Công nghệ DETECH</div>
		<div>
			- Mô hình dự án:<span style="white-space:pre"> </span>Tòa nhà văn phòng</div>
		<div>
			- Mục đích sử dụng:<span style="white-space:pre"> </span>Văn phòng và thương mại</div>
		<div>
			- Vị trí:<span style="white-space:pre"> </span>Số 107 Nguyễn Phong Sắc, Cầu Giấy, Hà Nội</div>
		<div>
			- Diện tích khuôn viên:<span style="white-space:pre"> </span>1,103m2</div>
		<div>
			- Tổng diện tích sử dụng:<span style="white-space:pre"> </span>14,299m2 (không tính 3 tầng hầm)</div>
		<div>
			- Số tầng:<span style="white-space:pre"> </span>17 tầng và 3 tầng hầm</div>
		<div>
			- Độ cao trần đến sàn:<span style="white-space:pre"> </span></div>
		<div>
			+ 2.85m (chiều cao tầng kinh doanh và thương mại)</div>
		<div>
			+ 2.65m (chiều cao tầng văn phòng)
			<div style="line-height: 25.2px;">
				- Năm hoàn thành:<span style="line-height: 25.2px; white-space: pre;"> </span>Quý III/2018</div>
			<div style="line-height: 25.2px;">
				- Thời hạn thuê:<span style="line-height: 25.2px; white-space: pre;"> </span>3-5 năm</div>
			<div style="line-height: 25.2px;">
				 </div>
			<div style="line-height: 25.2px; text-align: center;">
				<img alt="" src="https://file4.batdongsan.com.vn/2018/05/04/hmcVYWuR/20180504151528-b529.jpg" style="width: 450px; height: 586px;" /><br />
				<em>Phối cảnh tổng thể dự án Detech Tower II</em></div>
		</div>
	</div>
</div>
<p>
	 </p>
', N'<p>
	<strong>Detech Tower II</strong> tọa lạc tại số 107 Nguyễn Phong Sắc, phường Dịch Vọng Hậu, quận Cầu Giấy, Hà Nội.</p>
', N'<p>
	Đến với <strong>Detech Tower II, </strong>quý khách sẽ được thừa hưởng chuỗi các dịch vụ, tiện ích hiện đại, cơ sở vật chất phong phú ngay trong cũng như xung quanh dự án như quán cafe, ngân hàng, khách sạn cao cấp, trung tâm thương mại...</p>
<div style="line-height: 25.2px;">
