INSERT [dbo].[DuAn] ([Id], [TenDuAn], [DiaChi], [GiaTu], [ChuDauTu], [TongDienTich], [TienDoDuAn], [LoaiDuAnId], [QuyMoDuAn], [GioiThieuDuAn], [ViTri], [HaTang], [ThietKe], [MatBang], [Media], [HoTroTaiChinh], [TinhThanhPhoId], [QuanHuyenId], [SoSanPham], [AnhDaiDien], [NguoiDangId], [TrangThai], [NgayDang], [DoanhNghiepBDSId]) VALUES (8, N'C.T Plaza Võ Văn Kiệt ', N'22 Đường Võ Văn Kiệt, Quận 1, Hồ Chí Minh', 0.0000, N'C.T Group', 571, N'Đang cập nhật', 2, N'16 tầng gồm Căn Hộ Dịch Vụ, Trung Tâm Thương Mại, Văn Phòng, Hotel', N'<div class="prj-noidung a1">
	<h2>
		<strong>Thông tin dự án C.T Plaza Võ Văn Kiệt</strong></h2>
	<p>
		Tòa nhà phức hợp Cao ốc văn phòng và officetel <strong>C.T Plaza Võ văn Kiệt</strong> được phát triển bởi chủ đầu tư C.T Group với quy mô 16 tầng bao gồm căn hộ dịch vụ, trung tâm thương mại, văn phòng, hotel có vị trí vô cùng đắc địa trên ba mặt tiền Võ Văn Kiệt và Phó Đức Chính.</p>
	<p>
		- Tên dự án: C.T Plaza Võ Văn Kiệt<br />
		- Chức năng: Văn phòng, trung tâm thương mại, khách sạn<br />
		- Diện tích: 570.6m2<br />
		- Quy mô: 16 tầng bao gồm căn hộ dịch vụ, trung tâm thương mại, văn phòng, hotel<br />
		- Diện tích căn hộ officetel: Diện tích từ 22-36m2</p>
	<p style="text-align:center">
		<img alt="" src="http://file4.batdongsan.com.vn/2017/03/06/hmcVYWuR/20170306172042-2af5.jpg" style="height:654px; width:500px" /><br />
		<em>Phối cảnh dự án C.T Plaza Võ văn Kiệt </em></p>
</div>
<p>
	 </p>
', N'<p>
	<strong>C.T Plaza Võ Văn Kiệt </strong>tọa lạc ở số 22 Võ Văn Kiệt, quận 1, Tp.HCM.</p>
', N'<div class="prj-noidung a1">
	<p>
		Dự án sở hữu kết nối hạ tầng hiện đại với đầy đủ các tiện ích như gần Sở giao dịch Chứng khoán Tp.HCM và một dãy các ngân hàng lớn: Ngân hàng Nông nghiệp, Ngân hàng nhà nước, Ngân hàng BIDV, Vietcombank...</p>
	<p>
		<strong>CT Plaza Võ Văn Kiệt</strong> là dự án lý tưởng cho những người làm về tài chính, ngân hàng, chứng khoán hay các văn phòng lớn tại quận 1 với lợi thế lớn về giao thông, không lo kẹt xe và có thể di chuyển nhanh đến các quận lân cận. Từ tòa nhà có tầm nhìn ra ngã ba sông Sài Gòn, bến Nhà Rồng.</p>
	<p>
		Hai tầng hầm và sân tầng trệt dành để đậu xe rất rộng rãi ở cả 3 mặt của tòa nhà. Lầu 1 và tầng lửng là nơi lý tưởng cho văn phòng của các ngân hàng lớn. Từ tầng 2-11 là khu văn phòng cho thuê hiện đại, sang trọng kết hợp 7 loại hình nghệ thuật tạo ra hiệu suất cao cũng như sự thư giãn cho những người làm việc. Tầng 11-15 là căn hộ officetel.</p>
	<p>
		C.T Plaza Võ Văn Kiệt dành gần 50% tổng diện tích cho không gian cây xanh, mang đến các khu văn phòng thoáng đãng, gần gũi với thiên nhiên.</p>
	<p style="text-align:center">
		<img alt="" src="http://file4.batdongsan.com.vn/2017/03/07/hmcVYWuR/20170307083111-8b65.jpg" style="height:331px; width:550px" /><br />
		<em>Tầng thượng dành cho khu nhà hàng, cafe</em></p>
</div>
<p>
	 </p>
', N'<p>
	<img id="TopContent_ProjectDetail1_ctl00_imgOveralView" src="https://file4.batdongsan.com.vn/resize/658x579/2017/03/07/hmcVYWuR/20170307084741-228e.jpg" style="width:658px;" /></p>
', N'<p>
	<img alt="https://file4.batdongsan.com.vn/resize/658x-/2017/03/07/hmcVYWuR/20170307085130-e159.jpg" src="https://file4.batdongsan.com.vn/resize/658x-/2017/03/07/hmcVYWuR/20170307085130-e159.jpg" /></p>
', N'<p>
