<p>
	<img class="lg-object lg-image" src="https://file4.batdongsan.com.vn/2017/03/07/hmcVYWuR/20170307085533-b3fc.jpg" /></p>
', N'<p>
	Đang cập nhật</p>
', 1, 10, 140, N'/Content/Images/AnhDaiDienDuAn/23112019-20170306165719-dc1c.jpg', 1, 1, CAST(N'2019-11-23T10:55:36.010' AS DateTime), 10)
