INSERT [dbo].[DuAn] ([Id], [TenDuAn], [DiaChi], [GiaTu], [ChuDauTu], [TongDienTich], [TienDoDuAn], [LoaiDuAnId], [QuyMoDuAn], [GioiThieuDuAn], [ViTri], [HaTang], [ThietKe], [MatBang], [Media], [HoTroTaiChinh], [TinhThanhPhoId], [QuanHuyenId], [SoSanPham], [AnhDaiDien], [NguoiDangId], [TrangThai], [NgayDang], [DoanhNghiepBDSId]) VALUES (9, N'Tòa nhà Văn phòng Eurowindow', N'Đường Tôn Thất Tùng, Đống Đa, Hà Nội', 0.0000, N'Công ty CP Đầu tư và Xây dựng số 1 Hà Nội', 0, N'2040', 2, N'17 tầng nổi, 01 tầng kỹ thuật và 03 tầng hầm', N'<div class="prj-noidung a1">
	<h2>
		<strong>Thông tin dự án Tòa nhà Văn phòng Eurowindow</strong></h2>
	<p>
		Nằm tại ngã ba Tôn Thất Tùng - Chùa Bộc, dự án <strong>Tòa nhà văn phòng Eurowindow</strong> có vị trí giao thông thuận lợi. Đây là tòa nhà văn phòng hạng A, được thiết kế hiện đại với các hệ thống điều khiển thông minh và thang máy tốc độ cao. Mặt ngoài công trình được thiết kế bởi hệ thống vách nhôm kính lớn sang trọng của Eurowindow, khả năng cách nhiệt, cách âm cao.</p>
	<p>
		- Tên dự án: Tòa nhà văn phòng Eurowindow<br />
		- Vị trí: Số 2 Tôn Thất Tùng, quận Đống Đa, TP Hà Nội<br />
		- Chủ đầu tư: Công ty Cổ phần Đầu tư và Xây dựng số 1 Hà Nội<br />
		- Thiết kế kiến trúc: Công ty WATG (Mỹ)<br />
		- Tư vấn thiết kế thi công dự án: Công ty Khảo sát thiết kế và Tư vấn xây dựng - Bộ Quốc phòng<br />
		- Tổng diện tích đất: 2040,3m2<br />
		- Tổng diện tích mặt sàn xây dựng: 23953m2<br />
		- Quy mô: 17 tầng nổi, 01 tầng kỹ thuật và 03 tầng hầm<br />
		- Khởi công: 19/5/2015<br />
		- Dự kiến hoàn thành: tháng 12/2017</p>
	<p style="text-align:center">
		<img alt="" src="http://file4.batdongsan.com.vn/2016/09/27/lGk9zKqg/20160927150352-64d4.jpg" style="height:340px; width:500px" /><br />
		<em>Phối cảnh tổng thể dự án Tòa nhà Văn phòng Eurowindow</em></p>
</div>
<p>
	 </p>
', N'<p>
	<strong>Tòa nhà Văn phòng Eurowindow </strong>sở hữu vị trí đắc địa tại số 2 Tôn Thất Tùng, quận Đống Đa, TP Hà Nội, nơi có điều kiện giao thông thuận lợi, dễ dàng kết nối với trung tâm thành phố và khu vực xung quanh.</p>
', N'<div class="prj-noidung a1">
	<p>
		<strong>Tòa nhà Văn phòng Eurowindow</strong> cao 17 tầng nổi, 03 tầng hầm và 01 tầng kỹ thuật. Dự án có tổng diện tích mặt sàn là 23.953m2.</p>
	<p>
		Tầng 1 được sử dụng làm sảnh và khu dịch vụ; tầng 2 đến tầng 17 dành cho khu văn phòng. Tầng hầm có diện tích rộng rãi được dùng làm chỗ để xe với sức chứa 200 xe máy và 70 ôtô.</p>
	<p>
		Công trình được xây dựng theo kiến trúc hiện đại, hài hòa, thân thiện với môi trường và sử dụng tối đa các sản phẩm tiết kiệm điện năng. Đặc biệt, mặt ngoài của tòa nhà được thiết kế bởi hệ thống vách nhôm kính lớn và sử dụng hộp kính có lớp cản nhiệt mềm giúp chống nóng giữ nhiệt nhưng vẫn đảm bảo ánh sáng cho khu văn phòng.</p>
</div>
<p>
	 </p>
', N'<p>
	<img id="TopContent_ProjectDetail1_ctl00_imgOveralView" src="https://file4.batdongsan.com.vn/resize/658x579/2017/09/28/0I4XNtd4/20170928093442-7976.jpg" style="width:658px;" /></p>
', N'<p>
	Đang cập nhật</p>
', N'<p>
	<img class="carousel-center" src="https://file4.batdongsan.com.vn/resize/590x360/2017/11/22/0I4XNtd4/20171122100410-7808.jpg" style="display: inline; left: 160px; top: 0px; visibility: visible; position: absolute; z-index: 4; opacity: 1; width: 270px; height: 360px;" title="Dự án đã hoàn thiện" /></p>
