	<h2>
		<strong>Thông tin dự án IBC Building</strong></h2>
	<p>
		<strong>IBC Building</strong> là tòa nhà Trung tâm Thương mại Quốc tế - IBC - chuyên cho thuê văn phòng cao cấp. Tòa nhà tọa lạc ngay mặt tiền 1A Công trường Mê Linh, phường Bến Nghé, quận 1, nhìn ra sông Bạch Đằng, đài phun nước thoáng đãng, có chỗ để xe máy, đỗ ô tô, rất thuận tiện cho việc giao dịch của khách hàng.</p>
	<p>
		Với tổng diện tích hơn 1.600m2, các văn phòng cho thuê có diện tích từ 20m2 – 100m2, mang đến quý khách sự lựa chọn phù hợp với nhu cầu. Tòa nhà văn phòng cho thuê IBC Building được thiết kế diện tích sàn tại cao ốc khoảng 500m2 và được xây dựng 1 trệt - 1 lửng - 4 tầng - 1 thang máy.</p>
	<p style="text-align:center">
		<img alt="" src="http://file1.batdongsan.com.vn/file.398276.jpg" style="height:345px; width:550px" /></p>
	<p style="text-align:center">
		<em><img alt="" src="http://file1.batdongsan.com.vn/file.398278.jpg" style="height:412px; width:550px" /><br />
		Tòa nhà IBC Building</em></p>
</div>
<p>
