		<strong>Thông tin dự án The Navita</strong></h2>
	<p>
		Tọa lạc tại phường Tam Bình, quận Thủ Đức, Tp.HCM, <strong>The Navita</strong> nằm trong Khu phức hợp Lan Phương Garden rộng 8,4 ha, gồm 8 cao ốc, các trung tâm thương mại và một số nền đất. Từ dự án, cư dân có thể di chuyển nhanh chóng vào trung tâm thành phố theo Quốc lộ 13 hay chỉ mất 2,7km để đến đường Phạm Văn Đồng.<strong> </strong>Dự án do Công ty TNHH SX-TM Lan Phương làm chủ đầu tư.</p>
	<p>
		- Tên dự án: The Navita<br />
		- Chủ đầu tư: Lan Phương Group<br />
		- Đơn vị tư vấn: Savills<br />
		- Đơn vị thi công: Coteccons<br />
		- Quy mô: 50 ha<br />
		- Tổng mức đầu tư: 1000 tỷ đồng<br />
		- Tổng số căn hộ: 688 căn<br />
		- Các loại diện tích: 60-70-80-110m2<br />
		- Khởi công: Năm 2012<br />
		- Dự kiến hoàn thành: Năm 2015</p>
	<p style="text-align:center">
		<img alt="" src="http://file4.batdongsan.com.vn/2016/10/20/0I4XNtd4/20161020091735-18c5.jpg" style="height:339px; width:550px" /><br />
		<em>Phối cảnh dự án The Navita</em></p>
</div>
<p>
	 </p>
', N'<div class="prj-noidung a1">
	<p>
		Từ <strong>The Navita</strong>, cư dân chỉ mất 1km để đến bệnh viện Quốc tế Hạnh Phúc, 4km để đến Đại học Quốc Gia Tp.HCM hay kề bên là Hệ thống trường Quốc tế Việt Anh (VBIS).<strong> </strong>Ngoài ra, The Navita còn nằm rất gần các chợ lớn của Tp.HCM như chợ đầu mối 360m, chợ Tam Bình 1km hay chợ Thủ Đức 2,5km.</p>
	<p style="text-align:center">
		<img alt="" src="http://file4.batdongsan.com.vn/2016/09/12/0I4XNtd4/20160912082242-25c5.jpg" style="height:389px; width:550px" /><br />
