INSERT [dbo].[DuAn] ([Id], [TenDuAn], [DiaChi], [GiaTu], [ChuDauTu], [TongDienTich], [TienDoDuAn], [LoaiDuAnId], [QuyMoDuAn], [GioiThieuDuAn], [ViTri], [HaTang], [ThietKe], [MatBang], [Media], [HoTroTaiChinh], [TinhThanhPhoId], [QuanHuyenId], [SoSanPham], [AnhDaiDien], [NguoiDangId], [TrangThai], [NgayDang], [DoanhNghiepBDSId]) VALUES (13, N'City Mall', N'Đường Nguyễn Văn Linh, Phường 7, Quận 8, Hồ Chí Minh', 0.0000, N'Công ty CP Xây dựng Thương mại Phú Mỹ Lợi ', 302000, N'Đang cập nhật', 3, N'150 nền', N'<div class="prj-noidung a1">
	<h2>
		<strong>Thông tin dự án City Mall</strong></h2>
	<p>
		<strong>Dự án City Mall</strong> hứa hẹn là điểm đến đầu tư gia tăng giá trị hấp dẫn dành cho các nhà đầu tư, doanh nhân, các tiểu thương... Khu đô thị thương mại – dịch vụ City Mall Bình Điền sở hữu một vị trí thương mại đắc địa bậc nhất tại Sài Gòn - ngay cổng trung tâm thương mại và chợ đầu mối Bình Điền, trung tâm lưu chuyển hàng hóa Phú Mỹ Hưng quy mô lên đến 200ha và được bao bọc bởi sông Chợ Đệm, sông Cần Giuộc.</p>
	<p>
		- Tên dự án: City Mall<br />
		- Vị trí: Phường 7, Quận 8, Tp.Hồ Chí Minh<br />
		- Quy mô: 30.2ha<br />
		- Chủ đầu tư: Công ty CP XD - TM Phú Mỹ Lợi<br />
		- Đơn vị phân phối: Công ty cổ phần địa ốc Kim Oanh    <br />
		- Tiến độ: hạ tầng hoàn thiện 100%, đường trải thảm nhựa, đường nội bộ từ 12 – 36m.<br />
		- Mở bán: 150 nền, diện tích từ 100m² – 220m²<br />
		- Chính sách thanh toán linh hoạt, giao nền xây dựng ngay</p>
	<p style="text-align:center">
		<img alt="" src="http://file1.batdongsan.com.vn/file.481524.jpg" style="height:304px; width:550px" /><br />
		<em><span style="font-family:tahoma,geneva,sans-serif">Phối cảnh City Mall</span></em></p>
</div>
<p>
	 </p>
', N'<div class="prj-noidung a1">
	<p>
		<strong>City Mall </strong>tọa lạc ngay mặt tiền đại lộ Nguyễn Văn Linh – trục đường huyết mạch nối liền miền Đông và miền Tây Nam bộ. Từ dự án City Mall vào trung tâm quận 1 chỉ mất 10-15 phút thông qua các tuyến đường như quốc lộ 50, Phạm Hùng – Nguyễn Tri Phương, Nguyễn Văn Cừ... Đặc biệt, cầu Phú Định và đường Vành đai 2 nối đại lộ Nguyễn Văn Linh với đại lộ Võ Văn Kiệt sắp được khởi công, giúp việc lưu thông từ City Mall đến với trung tâm quận 5, 6 trở nên rất dễ dàng.</p>
	<p style="text-align:center">
		<img alt="" src="http://file1.batdongsan.com.vn/file.481532.jpg" style="height:411px; width:550px" /><br />
		<em>Sơ đồ vị trí dự án City Mall</em></p>
	<p>
		Dự án City Mall nằm sát với cổng vào trung tâm thương mại và chợ đầu mối Bình Điền – khu vực đang kinh doanh buôn bán sầm uất trong vai trò là nơi tập kết và phân phối hàng hóa từ khắp nơi đổ về cho người dân TPHCM. Ngoài ra, City Mall còn nằm kề trung tâm lưu chuyển hàng hóa Phú Mỹ Hưng quy mô lên đến 200 ha. Đây là một đầu mối lớn về tàng trữ và phân phối hàng hóa, khu bến cảng để khai thác tối đa vị trí lý tưởng của khu vực kết với khu vực nông nghiệp phía Nam khi được quy hoạch các tiểu khu như Khu thương mại Quốc tế, Khu thương mại đại lộ Nguyễn Văn Linh, Khu kho bãi công nghiệp, Khu cảng và trung chuyển hàng hóa, Khu dân cư hỗn hợp nhờ vị trí rất thuận lợi trong việc lưu thông từ mọi hướng bằng đường thủy và đường bộ.</p>
	<p style="text-align:center">
		<img alt="" src="http://file1.batdongsan.com.vn/file.481534.jpg" style="height:377px; width:550px" /><br />
		<em>Đại lộ Nguyễn Văn Linh</em></p>
	<p>
		Dự án City Mall<strong> </strong> còn được bao bọc bởi hệ thống sông Chợ Đệm – sông Cần Giuộc tạo nên mạng lưới giao thương bằng đường thủy với các tỉnh miền Tây vô cùng thuận lợi và nhanh chóng. Ngoài ra, dự án City Mall còn nằm gần trường một loạt trường đại học như RMIT, Kinh tế Tài chính, Văn Hiến, trường Quốc tế Canada, Trung tâm Thể dục Thể thao Lá Phong, sân vận động Thành Long cùng với các cơ sở thương mại và y tế như siêu thị BigC, Metro Bình Phú, Bệnh viện Chợ Rẫy 2, Bệnh viện Nhi đồng mới...</p>
	<p style="text-align:center">
		<img alt="" src="http://file1.batdongsan.com.vn/file.481533.jpg" style="height:377px; width:550px" /><br />
		<em>Trung tâm thương mại Bình Điền</em></p>
	<p>
		Tất cả các yếu tố nói trên biến dự án City Mall thành một khu đô thị có lợi thế khai thác hàng đầu khu Nam Sài Gòn, nhiều khả năng bùng nổ về giao thương trong tương lai không xa</p>
</div>
<p>
	 </p>
', N'<div class="prj-noidung a1">
	<p>
		Dự án <strong>City Mall</strong> là Cửa ngõ thương mại với đầy đủ các tiện ích:</p>
	<p>
		- Mặt tiền đại lộ Nguyễn Văn Linh<br />
		- Nằm ngay cổng chợ đầu mối Bình Điền tập trung các chợ sỉ (Hồ Thị Kỷ, An Lac, Trần Chánh Chiếu…)<br />
		- Mạng lưới giao thông thuận tiện : Bến xe miền Tây mới, tuyến Metro số 4, cầu Phú Định, Vành đai - ngoài, sông chợ đệm, sông Cần Giuộc.<br />
		- Giáp khu lưu thông hàng hóa Phú Mỹ Hưng (200ha)<br />
		- Gần Đại học RMIT, đại học Kinh tế Tài chính, đại học Văn Hiến, …<br />
		- Khu dân cư kinh doanh sầm uất<br />
		- Hạ tầng hoàn thiện, điện âm, đường nội bộ từ 12-36m</p>
	<p style="text-align:center">
		<img alt="" src="http://file1.batdongsan.com.vn/file.481531.jpg" style="height:389px; width:550px" /><br />
		<em>Sơ đồ phân lô dự án</em></p>
</div>
<p>
	 </p>
', N'<p>
