INSERT [dbo].[DuAn] ([Id], [TenDuAn], [DiaChi], [GiaTu], [ChuDauTu], [TongDienTich], [TienDoDuAn], [LoaiDuAnId], [QuyMoDuAn], [GioiThieuDuAn], [ViTri], [HaTang], [ThietKe], [MatBang], [Media], [HoTroTaiChinh], [TinhThanhPhoId], [QuanHuyenId], [SoSanPham], [AnhDaiDien], [NguoiDangId], [TrangThai], [NgayDang], [DoanhNghiepBDSId]) VALUES (14, N'Aeon Mall Long Biên ', N'Số 27 đường Cổ Linh, phường Long Biên, quận Long Biên, TP. Hà Nội', 0.0000, N'Công ty TNHH Aeonmall Himlam ', 9600000, N'Đang cập nhật', 3, N'Dự án 200 triệu đô la Mỹ này được triển khai trên tổng diện tích đất khoảng 9,6 ha, diện tích xây dựng 56.139 m2 chiếm 58,5%, tổng diện tích sàn xây dựng đạt 224.556 m2. Bãi đậu xe tại AEON Mall Long Biên có sức chứa hơn 1.000 xe hơi và hơn 3.500 xe máy.', N'<div class="prj-noidung a1">
	<h2>
		<strong>Thông tin dự án Aeon Mall Long Biên</strong></h2>
	<p>
		Trung tâm tâm thương mại (TTTM) <strong>Aeon Mall Long Biên</strong> tọa lạc tại khu công viên công nghệ thông tin Hà Nội tại phường Long Biên và phường Phúc Đồng, quận Long Biên, TP. Hà Nội. Dự án đã chính thức khai trương vào sáng ngày 28/10/2015. Aeon Mall Long Biên do Công ty TNHH Aeon Mall HimLam làm chủ đầu tư và được Công ty TNHH Đầu tư VTCO tham gia thiết kế chính cảnh quan xung quanh, hạ tầng kỹ thuật Khu công viên công nghệ thông tin Hà Nội.</p>
	<p>
		Đây là TTTM đầu tiên tại Hà Nội và thứ 3 tại Việt Nam của tập đoàn Aeon Nhật Bản với tổng vốn đầu tư hơn 200 triệu USD. Dự án tọa lạc trên khu đất rộng 9,6 ha đất với tổng diện tích sàn xây dựng hơn 130.000m2, dự kiến sẽ đón 20 triệu khách/năm.</p>
	<p>
		Quy hoạch chung xây dựng TP. Hà Nội tới năm 2030 và tầm nhìn tới năm 2050 đã được Thủ tướng Chính phủ phê duyệt ngày 26/7/2011, quận Long Biên được xác định là khu vực phát triển đô thị mới, tiếp tục chú trọng phát triển đầu tư xây dựng các dịch vụ xã hội công cộng và cơ sở hạ tầng.</p>
	<p>
		UBND TP. Hà Nội cũng đã lựa chọn TTTM Aeon Mall Long Biên là một trong các công trình dự án tiêu biểu của năm được gắn biển chào mừng Đại hội Đảng bộ Hà Nội lần thứ XVI. Việc này cũng như mở cửa TTTM Aeon Mall Long Biên đã khẳng định tình hữu nghị và mối quan hệ hợp tác hiệu quả giữa hai quốc giá, hai dân tộc Việt Nam - Nhật Bản.</p>
	<p>
		Với trang thiết bị, cơ sở vật chất được đầu tư xây mới hiện đại, đồng bộ cùng với uy tín thương hiệu, kinh nghiệm hơn 250 năm của Tập đoàn Aeon và vai trò của Công ty TNHH Đầu tư VTCO đảm nhận thiết kế chính cảnh quan xung quanh, hạ tầng Kỹ thuật Khu Công viên công nghệ thông tin Hà Nội. Công trình dự án TTTM Aeon MAIL Long Biên khi hoàn thiện sẽ tạo ra phong cách dịch vụ mua sắm, giải trí mới đồng bộ và hấp dẫn,… góp phần nâng cao chất lượng cuộc sống cho người dân Thủ đô.</p>
	<p style="text-align:center">
		<em><img alt="" src="http://file4.batdongsan.com.vn/2015/12/15/0I4XNtd4/20151215134119-7633.jpg" style="height:367px; width:550px" /><br />
		Phối cảnh dự án Aeon Mall Long Biên</em></p>
</div>
<p>
	 </p>
', N'<div class="prj-noidung a1">
	<p>
		<strong>Aeon Mall Long Biên</strong> tọa lạc tại Khu công viên công nghệ thông tin Hà Nôi, phường Phúc Đồng và phường Long Biên, quận Long Biên, TP. Hà Nội. Dự án cách hồ Hoàn Kiếm khoảng 15 phút đi bằng xe buýt.</p>
	<p>
		- Phía Đông Nam là tuyến đường quy hoạch trong Khu Công nghiệp Sài Đồng B<br />
		- Phía Đông Bắc là phần còn lại của Khu công viên công nghệ thông tin Hà Nội<br />
		- Phía Tây Bắc là tuyến đường dẫn lên cầu Vĩnh Tuy<br />
		- Phía Tây Nam là tuyên đường quy hoạch có mặt cắt ngang 40m</p>
	<p style="text-align:center">
		<img alt="" src="http://file4.batdongsan.com.vn/2016/04/05/0I4XNtd4/20160405095505-d457.jpg" style="height:357px; width:550px" /><br />
		<em>Vị trí Aeon Mall Long Biên</em></p>
</div>
<p>
	 </p>
', N'<div class="prj-noidung a1">
	<p>
		<strong>Aeon Mall Long Biên </strong>có mật độ xây dựng 58,5%, hệ số sử dụng đất 2,4. TTTM này sẽ khiến nhiều người bất ngờ những tiện ích như Khu đỗ xe ưu tiên dành cho người khuyết tật, phòng trẻ em có giường nằm thay bỉm, quần áo, khu vực riêng để rửa tay và mẹ có thể cho bé uống sữa thoải mái, khu thay đồ cho trẻ được trang trí với nhiều màu sắc. Trên mỗi chiếc giường cho bé đều có đai thắt an toàn; Khu vui chơi, giải trí ấn tượng với thiết kế của khu mê cung gương và khu nhà ma; Làng ẩm thực được bài trí độc lạ, thu hút, mang dáng dấp của thời bao cấp; Rạp chiếu phim CGV lớn nhất Việt Nam với tất cả gần 2.000 ghế ngồi; Khu vực gửi xe miễn phí với khoảng 10.000 xe máy và 1.000 ô tô; Aeon Mall Long Biên có wifi miễn phí và một số chuyến xe bus miễn phí dành cho khách hàng...</p>
	<p style="text-align:center">
		<img alt="" src="http://file4.batdongsan.com.vn/2015/12/15/0I4XNtd4/20151215143049-b118.jpg" style="height:309px; width:550px" /><br />
		<em>Tiện ích tại Aeon Mall Long Biên</em></p>
</div>
<p>
	 </p>
', N'<p>
	<img id="TopContent_ProjectDetail1_ctl00_imgOveralView" src="https://file4.batdongsan.com.vn/resize/658x579/2018/05/28/0I4XNtd4/20180528092229-5fda.jpg" style="width:658px;" /></p>
', N'<p>
	Đang cập nhật</p>
', N'<p>
	<iframe allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen="" frameborder="0" height="480" src="https://www.youtube.com/embed/Hgb-32Fv-S8" width="853"></iframe></p>
', N'<p>
	Đang cập nhật</p>
', 2, 39, 250, N'/Content/Images/AnhDaiDienDuAn/23112019-20151215134119-7633.jpg', 1, 1, CAST(N'2019-11-23T15:17:49.177' AS DateTime), 16)
