INSERT [dbo].[DuAn] ([Id], [TenDuAn], [DiaChi], [GiaTu], [ChuDauTu], [TongDienTich], [TienDoDuAn], [LoaiDuAnId], [QuyMoDuAn], [GioiThieuDuAn], [ViTri], [HaTang], [ThietKe], [MatBang], [Media], [HoTroTaiChinh], [TinhThanhPhoId], [QuanHuyenId], [SoSanPham], [AnhDaiDien], [NguoiDangId], [TrangThai], [NgayDang], [DoanhNghiepBDSId]) VALUES (15, N'LePARC by Gamuda', N'Đường Pháp Vân, Phường Yên Sở, Hoàng Mai, Hà Nội', 16800000.0000, N'Công ty TNHH Gamuda Land Việt Nam', 8998, N'Bàn giao nhà Quý IV/2016', 3, N'Tổ hợp khu vui chơi giải trí', N'<div class="prj-noidung a1">
	<h2>
		<strong>Thông tin dự án LePARC by Gamuda</strong></h2>
	<p>
		<strong>LePARC by Gamuda </strong>là 1 trong 4 dự án con của Gamuda City. Đây là khu bán lẻ đầu tiên do Gamuda Land đầu tư phát triển ở Việt Nam. Dự án sở hữu vị trí chiến lược cửa ngõ phía Nam Thủ đô, ngay sát đường cao tốc trên cao và đường vành đai 3, cách trung tâm TP. Hà Nội 10km về phía Nam.</p>
	<p>
		Là trái tim của Gamuda City, LePARC by Gamuda có cảnh quan xanh tươi, chỉ cách công viên Yên Sở với diện tích lớn tới 320 ha vài bước chân, nơi được coi là lá phổi xanh của thành phố. Từ dự án, cư dân dễ dàng kết nối với những khu vực lân cận của Hà Nội và những tỉnh phía Bắc.</p>
	<p style="text-align:left">
		- Tên chính thức: LePARC by Gamuda<br />
		- Loại hình: Tổ hợp khu vui chơi giải trí mua sắm và thư giãn trong không gian xanh của công viên Yên Sở<br />
		- Chủ đầu tư: Gamuda Land Việt Nam<br />
		- Đơn vị tư vấn bán hàng và tiếp thị độc quyền: CBRE (Việt Nam)<br />
		- Tổng diện tích sử dụng: 8998m2<br />
		- Thời hạn thuê: 5 năm<br />
		- Số phòng: 214 đơn vị diện tích cho thuê<br />
		- Diện tích đậu xe: 2000 xe<br />
		- Thời gian hoạt động: Từ tháng 5/2016</p>
	<p style="text-align:center">
		<img alt="" src="http://file4.batdongsan.com.vn/2016/05/18/0I4XNtd4/20160518100206-0ed8.jpg" style="height:413px; width:550px" /><br />
		<em>Phối cảnh tổng thể dự án LePARC by Gamuda</em></p>
</div>
<p>
	 </p>
', N'<div class="prj-noidung a1">
	<p>
		<strong>LePARC by Gamuda</strong> tọa lạc tại Km 1,5 Pháp Vân, công viên Yên Sở, quận Hoàng Mai, Hà Nội.</p>
	<p style="text-align:center">
		<img alt="" src="http://file4.batdongsan.com.vn/2016/05/18/0I4XNtd4/20160518111437-8ed4.jpg" style="height:344px; width:550px" /><br />
		<em>Vị trí LePARC by Gamuda trong Khu đô thị Gamuda Garden</em></p>
</div>
<p>
	 </p>
', N'<div class="prj-noidung a1">
	<p>
		<strong>LePARC by Gamuda </strong>chỉ cách trung tâm thành phố 20 phút lái xe, đây là điểm đến tiên phong trong xu hướng liên kết thương mại hóa toàn cầu. Dự án bắt nhịp phong cách kiến trúc trong tương lai, đồng thời mở ra một không gian xanh, thư giãn đầy phong cách.</p>
	<p>
		Khu thương mại LePARC by Gamuda có các tiện ích tối ưu hướng tới giá trị tinh thần cho các khách hàng như khu vực tổ chức sự kiện, khu vui chơi cho trẻ nhỏ, vườn nướng BBQ,... Bên cạnh đó, với tổng vốn đầu tư là 900.000 USD cho kế hoạch tổi chức trên 120 sự kiện Marketing trong suốt năm 2017, dự án hứa hẹn sẽ là nơi vui chơi, giải trí lý tưởng cho người dân Thủ đô theo tiêu chí Đẹp - Độc - Lạ.</p>
	<p style="text-align:center">
		<img alt="" src="http://file4.batdongsan.com.vn/2016/05/18/0I4XNtd4/20160518095639-2f8b.jpg" style="height:177px; width:500px" /><br />
		<em>Tiện ích tại dự án LePARC by Gamuda</em></p>
</div>
<p>
	 </p>
', N'<p>
	<img id="TopContent_ProjectDetail1_ctl00_imgOveralView" src="https://file4.batdongsan.com.vn/resize/658x579/2018/05/07/0I4XNtd4/20180507164622-0bf0.jpg" style="width:658px;" /></p>
', N'<p>
