		- Chủ đầu tư: Công ty cổ phần Đầu tư Dịch vụ Tài chính Hoàng Huy (HOSE)<br />
		- Vị trí: Phường Kênh Dương và Phường Vĩnh Niệm, Quận Lê Chân, TP. Hải Phòng<br />
		- Tổng diện tích: 5,8ha<br />
		- Quy mô: 174 căn liền kề (diện tích từ 95-139m2) và trung tâm mua sắm<br />
		- Đất ở: 29.758m2<br />
		- Đất trung TTTM: 26.309m2<br />
		- Thời gian phát triển dự án: 2018 - 2021</p>
