INSERT [dbo].[DuAn] ([Id], [TenDuAn], [DiaChi], [GiaTu], [ChuDauTu], [TongDienTich], [TienDoDuAn], [LoaiDuAnId], [QuyMoDuAn], [GioiThieuDuAn], [ViTri], [HaTang], [ThietKe], [MatBang], [Media], [HoTroTaiChinh], [TinhThanhPhoId], [QuanHuyenId], [SoSanPham], [AnhDaiDien], [NguoiDangId], [TrangThai], [NgayDang], [DoanhNghiepBDSId]) VALUES (18, N'Khu Đô Thị Cát Tường Western Pearl ', N'Đường Trần Hưng Đạo, Phường 5, Vị Thanh, Hậu Giang', 0.0000, N'Công ty CP Tập đoàn Địa ốc Cát Tường', 780000, N'Đang cập nhật', 4, N'Đang cập nhật', N'<div class="prj-noidung a1">
	<h2>
		<strong>Thông tin tổng quan dự án Khu Đô Thị Cát Tường Western Pearl </strong></h2>
	<p>
		<strong>Khu Đô Thị Cát Tường Western Pearl </strong>là dự án đầu tư trọng điểm của Tập Đoàn Địa Ốc Cát Tường tại TP. Vị Thanh, đồng thời cũng là 1 trong 6 phân khu chức năng quan trọng của TP. Vị Thanh nói riêng và tỉnh Hậu Giang nói chung. </p>
	<p>
		Nổi bật trong tổng thể Khu đô thị hành chính phức hợp TP. Vị Thanh, Khu Đô Thị Cát Tường Western Pearl được hưởng trọn làn gió mát lành từ dòng kênh Xáng Xà No trong xanh, cùng với đó còn được kiến tạo bởi bàn tay của đội ngũ kiến trúc sư tài hoa, tạo nên cảnh quan độc đáo bên cạnh những công trình kiến trúc hiện đại, tráng lệ, hứa hẹn sẽ mang lại những trải nghiệm ấn tượng dành riêng cho các chủ nhân tương lai.</p>
	<p>
		Khu Đô Thị Cát Tường Western Pearl đã được chính thức công bố vào ngày 28/9/2019. </p>
	<p>
		- Tên dự án: Khu Đô Thị Cát Tường Western Pearl (Cát Tường Western Pearl – Central Premium City)<br />
		-Vị trí: Phường 5, TP.Vị Thanh, Hậu Giang<br />
		- Chủ đầu tư: Công Ty Cổ Phần Tập Đoàn Địa Ốc Cát Tường (Cát Tường Group)<br />
		- Đơn vị Phát triển dự án: Công Ty Cổ Phần Kinh Doanh Nhà Đất Cát Tường<br />
		- Slogan:  Đô thị giao thương - Cộng đồng thịnh vượng<br />
		- Diện tích toàn khu: 78ha<br />
		- Tỷ lệ xây dựng: 45%<br />
		- Đất dành cho công viên cây xanh, cảnh quan và các công trình cộng đồng: 55%<br />
		- Các phân khu tại dự án:<br />
		+ Khu phố thương mại Kim Biên Sapphire<br />
		+ Khu phố thương mại Phú Nhuận Ruby<br />
		+ Khu phố thương mại Gia Định Topaz<br />
		+ Khu phố Bến Thành Norlan<br />
		+ Khu phố An Đông Donald<br />
		+ Khu biệt thự Tân định Armstrong<br />
		- Tổng mức đầu tư: 85 triệu USD<br />
		- Khởi công: 28/9/2019<br />
		-<span style="line-height: 25.2px; white-space: pre;"> </span>Đất nền: Giá bán từ 790 triệu đồng/nền <br />
		-<span style="line-height: 25.2px; white-space: pre;"> </span>Nhà phố thương mại (1 trệt + 2 lầu + sân thượng, 3PN, 5WC): giá từ 3,4 tỷ đồng/căn <br />
		-<span style="line-height: 25.2px; white-space: pre;"> </span>Các loại diện tích:  4x17m, 4x18m, 4x19m, 5x19m, 5x20m, 5x22m, 5x25.1m, 6.5x20m, 7x19m</p>
	<p style="text-align: center;">
		<img alt="" src="https://file4.batdongsan.com.vn/2019/10/05/hmcVYWuR/20191005093217-b16b.jpg" style="width: 550px; height: 251px;" /><br />
		<em>Phối cảnh tổng thể dự án Khu Đô Thị Cát Tường Western Pearl</em></p>
</div>
<p>
	 </p>
', N'<div class="prj-noidung a1">
	<p>
		<strong>Cát Tường Western Pearl </strong>sở hữu vị trí đẹp ngay khu trung tâm hành chính thành phố với các mặt tiền trên trục đường huyết mạch như đường Võ Nguyên Giáp, đường Trần Hưng Đạo, đường Võ Văn Kiệt, thuộc địa phận phường 5, TP. Vị Thanh - hội tụ đầy đủ những yếu tố kiến tạo nên một chốn an cư đẳng cấp bậc nhất Hậu Giang.</p>
	<p style="text-align: center;">
		<img alt="" src="https://file4.batdongsan.com.vn/2019/10/05/hmcVYWuR/20191005103252-59b9.jpg" style="width: 550px; height: 309px;" /><br />
