', N'<div class="prj-noidung a1">
	<p>
		<strong>Liền kề 319 Bồ Đề </strong>tọa lạc tại tổ 10, phường Bồ Đề, quận Long Biên, Hà Nội. Dự án sở hữu vị trí đắc địa, nằm ngay trung tâm quận Long Biên, cạnh tuyến đường lớn như đường 5 cũ, đường Nguyễn Văn Cừ, cao tốc Hà Nội Bắc Giang, cao tốc Hà Nội Hải Phòng... Từ dự án, cư dân dễ dàng, thuận tiện kết nối tới khu vực nội đô và những khu vực lân cận.</p>
	<p style="text-align:center">
		<img alt="" src="http://file4.batdongsan.com.vn/2017/05/31/0I4XNtd4/20170531101809-7b6a.jpg" style="height:264px; width:550px" /><br />
		<em>Vị trí dự án HC Golden City</em></p>
</div>
<p>
	 </p>
', N'<div class="prj-noidung a1">
	<p>
		<strong>Tiện ích nội khu</strong></p>
	<p>
		<strong>HC Golden City</strong> được đầu tư xây dựng các dịch vụ tiện ích như trường học, nhà hàng, bể bơi, spa, gym, trung tâm mua sắm... Đường bao quanh rộng rãi, vỉa hè lớn kết hợp với khuôn viên vui chơi, đi dạo và hệ thống cây xanh tạo không gian thoải mái, trong lành.</p>
	<p style="text-align:center">
		<img alt="" src="http://file4.batdongsan.com.vn/2017/05/31/0I4XNtd4/20170531101539-44fe.jpg" style="height:250px; width:550px" /></p>
	<p style="text-align:center">
		<img alt="" src="http://file4.batdongsan.com.vn/2017/05/31/0I4XNtd4/20170531101548-0248.jpg" style="height:373px; width:550px" /><br />
		<em>Các tiện ích tại dự án</em></p>
	<p>
		<strong>Tiện ích ngoại khu</strong></p>
	<p>
		Liền kề 319 Bồ Đề đối diện trường song ngữ WellSpring. Bên cạnh dự án là UBND phường Bồ Đề và chợ Bồ Đề. Ngoài ra, HC Golden City còn gần nhiều trường học, bệnh viện, trung tâm thương mại, khu dân cư lâu đời Bồ Đề, các khu đô thị lớn như Sài Đồng, Việt Hưng; cách khu Aeonmall chưa tới 10 phút đi xe, cách nút giao thông tầm 2,5km.</p>
</div>
<p>
