INSERT [dbo].[TinRaoBDS] ([Id], [TrangThai], [AnhDaiDien], [TieuDe], [TinhThanhPhoId], [QuanHuyenId], [DiaChi], [DienTich], [HuongNha], [SoPhong], [ThongTinMoTa], [Media], [TuKhoa], [BanDo], [NgayTao], [LoaiTinRao], [GiaTien], [AccountId], [HoTen], [SoDienThoai], [Email]) VALUES (1, 1, N'/Content/Images/AnhDaiDienTinRao/09122019-no-photo-available-300x225.png', N'Cần mua nhà đất TPHCM từ 1-15 tỷ, chính chủ, không tiếp môi giới ', 1, 24, N'Huyện Bình Chánh, Huyện Củ Chi, Quận Gò Vấp, Quận 12, Quận Thủ Đức - Hồ Chí Minh', 100, N'Gần công viên', 4, N'<div class="pm-mota">
	Thông tin mô tả</div>
<div class="pm-content stat">
	<div class="pm-desc">
		1. Tìm nhà Gò Vấp.<br />
		Giá 5 - 6 tỷ.<br />
		<br />
		2. Tìm nhà đất.<br />
		Dưới 3 tỷ.<br />
		Đầu tư.<br />
		3. Tìm nhà hẻm xe hơi.<br />
		5 - 6 tỷ.<br />
		Mua ở.<br />
		4. Tìm nhà.<br />
		Phường Hiệp Bình Chánh, Thủ Đức.<br />
		5 - 6 tỷ.<br />
